INSERT INTO `lien_bound_summaries` (`id`, `state_id`, `project_type_id`, `rights_available`, `claimant`, `prelim_notice`, `other_notice`, `lien`, `suit`, `notes`, `created_at`, `updated_at`) VALUES
(1, 14, 1, 'Mechanics\' Lien', 'Contractor', 'Sworn Statement: To the Owner before payment \"of all parties furnishing materials and labor and the amounts due or to become due to each.\" 770 ILCS 60/5', 'Not Required', 'Claim for Lien: File with county any time after contract is entered into.\r\n -Against innocent 3rd Party purchaser: Within 4 months after completion of or final delivery.\r\n -Against Original Owner: Within 2 years after completion of work or additional work or final delivery. ILCS 60/7', 'File in county of improvement within 2 years after completion of the contract or additional work or final material delivery. ILCS 60/9.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(2, 14, 1, 'Mechanics\' Lien', 'Subcontractor,\r\nMaterialman', 'Notice to Owner:\r\n -Owner Occupied Residence: To Owner within 60 days from \"first furnishing material l or labor\". 770 ILCS 60/5, 60/21', 'Subcontractor 90 Day Notice: To Owner & Lender any time after contract is entered into, but within 90 days after completion of work or final delivery. Then, must wait 10 days before filing lien or suit. ILCS 60/24, 60/28.', 'Claim for Lien: File with county any time after contract is entered into.\r\n -Against 3rd Party: Within 4 months after completion of work or additional work or final delivery.\r\n -Against Owner: Within 2 years after completion of work or additional work or final delivery. ILCS 60/7.', 'File in county of improvement 10 days after Notice and within 2 years after completion of the contract or additional work or final material delivery. ILCS 60/28, 60/9.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(3, 14, 2, 'Suit on Payment Bond - projects over $5,000', 'Subcontractor, Materialman (check tier limitation)', 'Not Required', 'Notice of Claim on Bond: To Public Authority within 180 days after &quot;last item of work&quot; or furnishing of &quot;last item of materials&quot; and copy of notice to contractor 10 days thereafter. ILCS 550/2', 'Not Available', 'File not before the expiration 120 days from &quot;last item of work&quot; or furnishing of &quot;last item of materials&quot; but not later than 6 months after acceptance by the public authority.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(4, 14, 2, 'Lien on Unexpended Funds', 'Subcontractor, Materialman (check tier limitations). Lien rights limited to funds owed to claimant\'s immediate contractor at time of claim', 'Not Required', 'Notice: To clerk or secretary or director of Public Authority &amp; contractor prior to payment of funds. ILCS 60/23(b) and (c). \r\nDemand by Contractor: Within 30 days thereafter. ILCS 60/23(b) and (c).', 'Not Available', 'SUIT State and Any Public Authority: File for an accounting within 90 days after filing Notice. ILCS 60/23 (b) and (c).\r\n State is Public Authority: File &quot;not less than 15 days before the date when the appropriation from which the money is to be paid will lapse.&quot; ILCS 60/23(c)', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(5, 5, 1, 'Mechanics\' Lien', 'Original Contractor\r\n(in Privity with Owner)', 'Not Required', 'Not Required', 'Notice of Completion Recorded: File lien within 60 days after Owner records. CC §3115 \r\nNotice of Completion NOT Recorded: File lien within 90 days after actual completion of the project. CC §3115', 'File suit within 90 days after lien recorded. CC §3144', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(6, 5, 1, 'Mechanics\' Lien', 'Subcontractor,Materialman(NOT in Privity with Owner)', 'California Preliminary 20-Day Notice (Private Work): to Owner, Contractor and Lender within 20 days after first performance.* CC §3097 & §3114', 'Not Required', 'Notice of Completion Recorded: File lien within 30 days after owner records Notice of Completion. CC §3116\r\n Notice of Completion NOT Recorded: File lien within 90 days after actual completion of the project. CC §3116', 'File suit within 90 days after lien recorded. CC §3144', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(7, 5, 1, 'Stop Notice on Unexpended Construction Loan Funds', 'Contractor - Only available if holder of funds is third-party lender. (Can do Unbonded, Stop Notice to Owner, but no greater cause, than Breach of Contract of action).', 'Not Required', 'Not Required', 'Bonded Stop Notice:\r\n- Notice of Completion Recorded: to lender within 60 days after Owner records.\r\n- Notice of Completion NOT Recorded: 90 days after actual completion of the project. CC §3160(b)', 'File within 90 days after expiration of the mechanics\' lien period, but not within the first 10 days after service. (CC §3172)', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(8, 5, 1, 'Stop Notice on Unexpended Construction Loan Funds', 'Subcontractor,Materialman (Neither one in privity with Owner)', 'California Preliminary 20-Day Notice (Private Work): to Owner, Contractor and Lender within 20 days after first performance.* CC §3097 & §3160', 'Not Required', 'Stop Notice:\r\n- Notice of Completion Recorded: to lender or owner within 30 days after Owner records. \r\n- Notice of Completion NOT Recorded: 90 days after actual completion of the project. CC §3160(b)', 'File within 90 days after expiration of the mechanics\' lien period, but not within the first 10 days after service. (CC §3172)', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(9, 5, 2, 'Payment Bond', 'Subcontractor, Materialman (Neither in Privity with Original Contractor)', 'Preliminary 20-Day Notice (Public Work): To contractor, and public agency within 20 days after first performance.* CC §3098 &amp; §3252', 'Fails to provide 20-day Notice: \r\n-Notice of Completion recorded: send post-completion bond notice to surety and bond principal within 15 days of notice of completion. \r\n-Notice of Completion NOT Recorded: 75 days of completion of the project. CC §3252(b)', 'Not Available', 'At any time after performance but not more than 30 days + 6 months after Notice of Completion is recorded or not more than 90 days + 6 months after actual completion or acceptance of the project if no such notice is given. CC §3249', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(10, 5, 2, 'Stop Notice on Unexpended Funds', 'Preliminary 20-day Notice (Public Work): To Contractor and Public Agency within 20 days after first performance.* CC §3098 &amp; §3252', 'Preliminary 20-Day Notice (Public Work): To contractor, and public agency within 20 days after first performance.* CC §3098 &amp; §3252', 'Stop Notice to Public Authority:\r\n -Notice of Completion recorded: within 30 days after recording by Public Authority. \r\n-Notice of Completion NOT recorded: 90 days after completion of the project or acceptance. CC §3184', 'Not Available', 'File within 90 days following expiration of period within which Stop Notice must be filed, but Not within first 10 days after service of Stop Notice. CC §3210', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(11, 20, 2, 'Subcontractor, Materialman', 'None Required', 'None Required', 'Mechanics\' Lien:  available in Public Works other than state owned property. Same procedure as with Private Works; Available on municipal or school property.', 'Record lien within 90 days of last performance, but in any event before a bona fide purchaser takes title.', 'File suit within 120 days of last performance.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(12, 21, 1, 'Mechanics\' Lien (Must be 15% or more of total project §9-102)', 'Contractor', 'Not Required', 'Not Required', 'Not Available', 'Petition to Establish and Enforce a Mechanic\'s Lien: File suit to establish lien within 180 days of last performance (must include \"all material papers\").', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(13, 22, 2, 'Suit against Prime Contractor\'s Payment Bond Surety', 'Subcontractor or Materialman (in privity with Prime Contractor.) Mass. General Laws c. 149, Sec. 29.', 'Not Required', 'Not Required', 'Not Required', 'File suit within 1 year from date last furnished labor and/or material required by subcontract.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(14, 24, 1, 'Mechanics\' Lien', 'Subcontractor, Materialman, Sub-subcontractor', 'Subcontractor\'s Pre-Lien Notice: Prescribed written Notice to Owner within 45 days of first Performance. 1&2 M.S.A.§514.011(2)', 'Give notice within 120 days of last performance.', 'Statement of Mechanic\'s Lien Claim: Record lien within 120 days of last performance.', 'File suit within 1 year of last performance.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(15, 10, 1, 'Construction Liens', 'Contractor, Subcontractor, Sub-subcontractor, Laborer, or Materialman to any of the above or to Owner. \r\nLien rights do not extend below level of sub-subcontractor or materialman to sub-subcontractor. Sec.713.01(17). Liens are available for solid waste collection and disposal. Sec.713.01(14).', 'Notice to Owner: Lienor who is not in direct privity with owner must serve written notice to owner before commencing, or not later than 45 days after commencing, to furnish services or materials, except for specially manufactured materials, (at start of manufacture) but in any event before owner\'s disbursement of final payment. Sec. 713.06(2)(a).  (after contractor has furnished final contractors affidavit pursuant to Sec.713.06(3)(d)(1).) \r\nSub-subcontractor or materialman to subcontractor: Must serve copy of notice on contractor. \r\nMaterialman to sub-subcontractor: Must serve copy of notice on contractor and on subcontractor if materialman knows name and address of the subcontractor. Service must be made by actual delivery or certified mail, posting permissible only if hand delivery or certified mail unavailable. Must have attempted. Sec.713.18. \r\nNotice to owner is effective upon receipt, not mailing. Day of initial performance counts in calculating 45 day period. Failure to give timely notice is complete defense to enforcement of lien. Sec.713.06(2)(a). Statutory form of notice should be used. Sec. 713.06(2)(c).', 'Upon written demand lienor must provide sworn statement of Account containing information on nature & quantity of services and materials & labor, amount paid, amount due, and amount to become due, or the lienor is deprived of its\' lien. Must use statutory form.', 'Claim of Lien: Lien must be perfected by recording claim of lien with appropriate clerk of court in County where real property improved located at any time during progress of work or thereafter but not later than 90 days after the final furnishing of the labor or services or materials by the lienor. Sec.713.08(5). Statutory form of claim of lien should be used. Sec.713.08(3). Perfected lien operates as direct lien on the real property improved for any money owed the lienor. However, total amount of all liens may not exceed price fixed by direct contract. Sec.713.05; 713.06(1).6', 'Commence action to enforce construction lien within one (1) year after claim of lien has been recorded. Sec.713.22(1). If owner records and serves a notice of contest of lien, suit must be filed within 60 days of service of notice. Sec. 713.22(2)', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(16, 33, 1, 'Mechanics\' Lien', 'Contractor, Subcontractor, Materialman (Materialman to Materialman not entitled to Mechanic\'s Lien)', 'Not Required', '-Owner / Contractor may demand an itemized statement from lienor detailing items of labo and/or material, and value thereof that make up lien amount, as well as the terms of the contract under which the items were furnished. Once served with a demand for an itemized statement, lienor has 5 days to provide written response. -Lienor may make a demand to examine books or records of trustee or may demand a verified statement from trustee regarding trust assets once every 30 days from the date his trust claim became payable', 'Notice of Lien ( Private Project): \r\n-Filed at any time during  performance, but not later than 8 months from the lienor\'s furnishing of the last labor or the last material on the job (4 months for a single family dwelling). \r\n-Copy served upon the owner, the contractor, and the subcontractor (as relevant) 5 days before through 30 days after filing Notice. \r\nProof of Service of the Notice of Lien: \r\n-Serve upon the above required parties \r\n-Recorded with the County Clerk within 35 days after the Notice of Lien is filed, or the notice terminates as a lien.', 'Lien good for 1 year from the date of filing lien only. Action must be commenced AND Notice of Pendency filed within the lien period (lien may be self extended for 1 year by filing a written extension with County Clerk, except in the case of a single family dwelling. Thereafter, lien can be further judicially extended by court order. Lien on single family dwelling may only be extended by court order. Commencing action without filing Lis Pendens or obtaining an order extending lien does not extend lien.) Notice of pendency lasts for only 3 years, irrespective of commencement of foreclosure action. Should extend lien each year and renew Notice of Pendency every 3 years.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(17, 10, 1, 'Payment Bonds Covering Construction Projects', 'Subcontractor, Sub-subcontractor, Laborer, or Materialman to Contractor or to either of the above. Sec. §713.01(17); §713.23(2).', 'Notice to Contractor: Either before beginning or within 45 days after beginning to furnish labor, materials, or supplies, except for specially manufactured materials, &quot;a lienor who is not in privity with the contractor&quot; (i.e., a sub-subcontractor, a materialman to a subcontractor, or a materialman to a sub-subcontractor) must serve the contractor with written notice that the lienor will look to the contractor\'s bond for protection on the work. If no notice of commencement is recorded, or the notice of commencement does not refer to the bond, and if the lienor not in privity with the contractor is not otherwise notified in writing of the existence of the bond, that lienor has 45 days from the date the lienor is notified of the existence of the bond within which to serve the notice. The statutory form of notice to contractor should be used. Sec. §713.23(1)(c).', 'Notice of Nonpayment (Private Project): As a condition precedent to a recovery under the payment bond, a lienor must serve written notice of nonpayment on the contractor and the surety no later than 90 days after the lienor\'s &quot;final furnishing&quot; (i.e., last delivery to job site) of labor, services, or materials. Retainage that does not exceed 10% of the labor, services, or materials furnished, however, is not considered a nonpayment requiring the service of such a notice. The statutory form of Notice of Nonpayment should be used. Sec. §713.23(1)(d).', 'See page 1 for lien requirements. Lien should be filed in addition to bond claim. Lien should be recorded along with notice of nonpayment. If bond is a conditional bond (§713.245), lien MUST be filed to perfect bond claim rights.  \n\nFiling a notice of bond automatically transfers the lien to the bond. ', 'Commence action against contractor or against surety on the bond within one (1) year from last performance of the labor or completion of delivery of the materials and supplies. Sec. §713.23(1)(e). \r\nWaiver and release of lien releases like amount of lienor\'s right to a claim against a private bond. Sec. §713.23(5) \r\nIf contractor serves a notice of contest of claim, must file suit within 60 days of notice. Sec. §713.23(1)(e)', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(18, 10, 2, 'Payment Bonds Covering Public Construction Projects', 'Subcontractor or Material Supplier in privity with General Contractor... No notice.', 'Not Required', 'Not Required', 'Not Required', 'Commence action against contractor or against surety on the bond within one (1) year from last performance of the labor or completion of the delivery of the materials or supplies. Sec.255.05(2). However, if prime contractor serves claimant with a notice of contest of bond claim, period for filing suit may be limited to as few as 60 days from service of the notice.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(19, 10, 2, 'Payment Bonds Covering Public Construction Projects', 'Subcontractor, Sub-subcontractor or Materialman to Contractor or to either of the above not in privity with General Contractor. Please note that the preceding is not in privity with General Contractor, and is subject to prime contractor\'s right to serve on claimant a demand for sworn statement of account. If such statement is not provided within 30 days of demand, claimant\'s bond rights are lost.', 'Notice of Intent to Look to the Bond: Within 45 days after beginning to furnish labor, materials, or supplies, except for specially manufactured materials, for the prosecution of the work, a claimant (except a laborer) who is not in privity with the prime contractor and who has not received payment for his labor, materials, or supplies, must furnish the prime contractor with a notice that he intends to look to the bond for protection.', 'Notice of Nonpayment (Public Project): Within 90 days after performance of the labor or after complete delivery of materials and supplies (or, with respect to rental equipment, within 90 days after the date that the rental equipment was last on the job site available for use) but not before 45 days after the first furnishing labor, materials, or equiptment, a claimant who is not in privity with the contractor and who has not received payment for his labor, materials, or supplies must deliver to the contractor and to the surety written notice of the performance of the labor or delivery of the materials or supplies and of the nonpayment.', 'Not Available', 'Commence action against contractor or against surety on the bond within one (1) year from last performance of the labor or completion of the delivery of the materials or supplies. Sec.255.05(2). However, if prime contractor serves claimant with a notice of contest of bond claim, period for filing suit may be limited to as few as 60 days from service of the notice.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(20, 10, 2, 'Suit against Contractor or Surety Exclusively to Collect Retainage', 'Subcontractor, Sub-subcontractor or Materialman to Contractor or to either of the above', 'Same as bond claim', 'Same as bond claim', 'Not Available', 'File before last to occur of 1 year from last performance or 90 days from final payment or accounting by Owner to Contractor. Certain conditions must be satisfied before suit can be filed. 255.05(10)', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(21, 33, 1, 'Suit on Labor &amp; Material Payment Bond', 'Usually similar to claimant\'s under Lien Law. (Language of Bond controls).', 'Notice is usually required and depends on claimant\'s relationship to principal and General Contractor.', 'Not Required', 'Not Available', 'Important that copy of Labor &amp; Material payment bond be obtained in order to determine time limitation for suit.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(22, 33, 2, '\"\"Lien\" Against Unpaid Retention\"', 'Entities performing labor for or furnishing materials to a contractor, his subcontractor or legal representative for the construction or demolition of a public improvement pursuant to a contract. (NYS Lien Law §5)', 'Not Required', '-Owner / Contractor may demand an itemized statement from lienor detailing items of labo and/or material, and value thereof that make up lien amount, as well as the terms of the contract under which the items were furnished. Once served with a demand for an itemized statement, lienor has 5 days to provide written response. \r\n-Lienor may make a demand to examine books or records of trustee or may demand a verified statement from trustee regarding trust assets once every 30 days from the date his trust claim became payable', 'Notice of Lien: Filed any time before or up to 30 days after completion &amp; acceptance of the entire project. Notice of Lien must be given to head of department or bureau of public agency and with the comptroller of the state of NY or with the financial officer of the public corporation with proof of service by certified mail upon the party by whom the lienor was employed. The notice must be filed twice, once with the one in charge of construction and with the person responsible for payment with copies to contractor and subcontractor, if applicable. Notice of lien must be sent to contractor and sub-contractor 5 days before through the day of filing lien.', 'A lien is valid for 12 months from the time of filing. An action must be commenced AND Notice of Pendency filed during the one year period. (lien may be self extended for 1 year by filing written extension with public official or corporation. Thereafter, lien can be further extended by court order. Commencing an action without a Notice of Pendency or an order extending lien does not extend the lien.) Notice of pendency lasts for only 3 years, irrespective of commencement of foreclosure action. Should extend lien each year and renew Notice of Pendency every 3 years.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(23, 33, 2, 'Suit on Labor & Material Payment Bond', 'Subcontractor, Materialman Recovery limited to Second Tier Subcontractor (i.e. a subcontractor)', 'Notice usually not required for persons contracting directly with the prime contractor &amp; it is important that copy of bond be obtained and all requirements contained in the bond are also satisfied.', 'Notice of Claim on Bond (Public Project): Second tier claimants on statutory bond must give Notice of Claim to the contractor within 120 days of last performance by personal or registered mail. \r\nBonds may differ from statutory minimum standards, but may not require more restrictive notice. Review bond language.', 'Not Available', 'Action must be commenced within 1 year from the date on which final payment under the claimant\'s subcontract becomes due. (Review bond language).', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(24, 44, 1, 'Mechanics\' Lien', 'Original Contractor', 'Not Required', 'Not Required', 'Lien Affidavit: Record not later than the fifteenth day of the fourth month (third month, if residential) after the day on which the debt accrues (TPC Section §53.052) (debt accrues upon the last day of the month in which written declaration of termination of the original contract by either party is received by the other party, or last day of the month in which the original contract was completed, finally settled or abandoned). {TPC §53.053 b.}. Must serve owner a copy of the Affidavit within 5 days of filing. TPC §53.055', 'Residential Construction: The later date of: (1) 1 year after the last day claimant may file a lien; or (2) 1 year after date of completion, termination or abandonment or work under lien. TPC §53.158.\r\n All Other Construction: The later date of: (1) 2 years after last day claimant may file a lien; or (2) 1 year after date of completion, termination abandonment of work under lien. TPC §53.158.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(25, 44, 1, 'Mechanics\' Lien', 'Subcontractor/ Materialman (in privity with prime contractor)', 'Not Required', 'Written notice to owner or reputed owner, with copy to the original contractor, not later than the fifteenth day of the third month following each month in which all or part of labor was performed or material delivered. (TPC §53.056 b.)', 'Record lien not later than fifteenth day of fourth month (third month, if residential) after debt accrues. TPC §53.052. (debt accrues on last day of last month in which labor performed or material furnished). {TPC § 53.053 c.}. Must serve owner or reputed owner and original contractor a copy of the affidavit within 5 days of filing. TPC §53.055.', 'Residential Construction: The later date of: (1) 1 year after the last day claimant may file a lien; or (2) 1 year after date of completion, termination or abandonment or work under lien. TPC § 53.158. All Other Construction: The later date of: (1) 2 years after last day claimant may file a lien; or (2) 1 year after date of completion, termination abandonment of work under lien. TPC § 53.158.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(26, 44, 1, 'Mechanics\' Lien', 'Subcontractor/ Materialman (not in privity with the prime contractor)', 'Not Required', '1.) Written notice of debt to original contractor not later than the fifteenth day of the second month following each month in which all or part of claimant\'s labor was performed or material delivered.\r\n 2.) Written notice to owner or reputed owner and original contractor not later than the fifteenth day of the third month following each month in which all or part of labor was performed or material delivered. (TPC §53.056 b.)', 'Lien Affidavit: Record not later than fifteenth day of the fourth month (third month, if residential) after the day on which the debt accrues (debt accrues on the last day of the last month in which labor performed or material furnished). {TPC § 53.053 c.}. Must serve owner or reputed owner and original contractor a copy of the affidavit within 5 days of filing. TPC §53.055.', 'Residential Construction: The later date of: (1) 1 year after the last day claimant may file a lien; or (2) 1 year after date of completion, termination or abandonment or work under lien. TPC §53.158. \r\nAll Other Construction: The later date of: (1) 2 years after last day claimant may file a lien; or (2) 1 year after date of completion, termination abandonment of work under lien. TPC §53.158.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(27, 44, 1, 'For specially fabricated material (unsuitable for use elsewhere)', 'Original Contractor', 'Notice to Owner: To Owner or reputed owner not later than fifteenth day of the second month following the month in which the order was received and accepted by claimant.', 'Not Required', 'Record lien not later than fifteenth day of fourth month (third month, if residential) after debt accrues. (debt accrues on last day of last month in which materials were furnished, delivered or would normally have been required at the job site; or of month in which contract was breached or terminated by owner or contractor). {TPC § 53.053 d.}. Must serve owner or reputed owner and original contractor a copy of the affidavit within 5 days of filing. TPC §53.055.', 'Suit mist be commenced within 6 month after maturity of entire debt.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(28, 44, 1, 'For specially fabricated material (unsuitable for use elsewhere)', 'Subcontractor, Materialman', 'Notice to Owner: To Owner or reputed owner &amp; contractor not later than the fifteenth day of the second month following month in which the order was received and accepted by claimant. {TPC § 53.058 b.}.', 'Notice of Unpaid Balance:\r\n -If delivery has been made or if the normal time for delivery is passed: To original contractor not later than fifteenth day of the second month following each month in which there was performance and in addition, written Notice of Unpaid Balance to Owner or reputed owner &amp; Original Contractor not later than Fifteenth day of the third month following each month in which there was performance. {TPC § 53.056 &amp; .058}.', 'Record lien not later than fifteenth day of fourth month (third month, if residential) after debt accrues. Debt accrues on last day materials were furnished, delivered or would normally have been required at the job site; or of month in which contract was breached or terminated by Owner or Contractor. {TPC § 53.053 d}. Must serve owner or reputed owner and original contractor a copy of the affidavit within 5 days of filing. TPC §53.055.', 'Residential Construction: The later date of: (1) 1 year after the last day claimant may file a lien; or (2) 1 year after date of completion, termination or abandonment or work under lien. TPC §53.158. \r\nAll Other Construction: the later date of: (1) 2 years after last day claimant may file a lien; or (2) 1 year after date of completion, termination abandonment of work under lien. TPC §53.158.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(29, 44, 1, 'Mechanics\' Lien Stop Notice &amp; Lien on Funds where contract calls for retainage', 'Original Contractor', 'In addition to the above mentioned Liens, claimant may give written Notice of Retainage Claim to Owner or reputed owner not later than the fifteenth day of the second month and third month following each month in which materials delivered or labor performed or material delivered, if retainage called for in contract. {TPC § 53.057} {TPC § 53.058 b.}.', 'Not Required', 'Lien on Retained Funds: File lien affidavit within thirty days after work completed (TPC 53.103) Lien expires when any of the following are true 1) time for filing the affidavit of Mechanics\' Lien has passed, 2) if Lien affidavit has been filed, until the lien claim has been satisfied or released 3) claim is paid, settled, discharged, or indemnified. {TPC §53.082}', 'Written demand to the owner for amount of claim {TPC §53.083}', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(30, 44, 1, 'Mechanics\' Lien Stop Notice &amp; Lien on Funds where contract calls for retainage', 'Subcontractor, Materialman', 'In addition to the above mentioned Liens, claimant may give written notice to original contractor not later than the fifteenth day of the second month following each month in which material was delivered or labor performed, and same notice to owner or reputed owner and original contractor not later than the fifteenth day of the third month following each month in which material was delivered or labor performed, if retainage called for in contract. {TPC § 53.057}', 'Not Required', 'Lien on Retained Funds: File lien affidavit within thirty days after work completed {TPC 53.103} Lien expires when any of the following are true 1) time for filing the affidavit of Mechanic\'s Lien has passed, 2) if Lien affidavit has been filed, until the lien claim has been satisfird or released 3) claim is paid, settled, discharged, or indemnified. {TPC §53.082}', 'Written demand to the owner for amount of claim to owner with copy to contractor of demand to contractor. {TPC §53.083}', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(31, 44, 1, 'Suit on Private Bond -minimum 100%', 'Subcontractor, Materialman', 'If perfecting solely under {TPC 53.206}, same as with Mechanics\' Lien, except all required Notices to Surety instead of owner.', 'If perfecting solely under {TPC 53.206}, same as with Mechanics\' Lien, except all required Notices to Surety instead of owner. {TPC 53.206}. No need to give Notice to Surety under {TPC 53.057} unless claimant has direct contractual relationship with original contractor and agreed retainage exceeds ten (10%) percent. Also, no need to give Notice to Surety under §53.058(b).', 'If relying solely on {TPC 53.206}, no need to file lien affidavit, otherwise same as with Mechanics\' Lien.', 'File suit not more than 1 year after claim perfected, if bond recorded at time lien affidavit filed, otherwise within 2 years after claim perfected. {TPC 53.208}.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(32, 44, 1, 'Suit on Bond to Remove Mechanics Lien', 'Subcontractor, Materialman', 'Not Required', 'Not Required', 'Not Available', 'Same as on liens, but not more than 1 year after notice of bond is served or underlying lien claim becomes unredeamable under § 53.175.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(33, 44, 2, 'Suit on Payment Bond -minimum 100% where prime contract is over $25,000.00 &amp; claim against retainage if called for in contract.', 'Subcontractor, Materialman (direct contractual relationship with prime contractor). {TGC § 2253.041}.', 'Not Required', 'Not Required', 'Notice of Nonpayment and statement of Account: To Prime Contractor &amp; Surety accompanied by a sworn statement of account on or before the fifteenth day of the third month following each month in which there was performance. {TGC § 2253.041}. \r\nNotice of Claim for Retainage: To Prime Contractor and Surety on or before 90th day after final completion of contract (not required if amount claimed as part above Notice). {TGC § 2253.046}.', 'File suit not more than 1 year after date of giving notice. {TGC 2253.078}.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(34, 44, 2, 'Suit on Payment Bond -minimum 100% where prime contract is over $25,000.00 &amp; claim against retainage if called for in contract.', 'Subcontractor, Materialman (no direct contractual relationship with prime contractor). {TGC § 2253.047}.', 'Notice of Retainage Agreement: To Prime Contractor on or before the fifteenth day of the second month after the date of first performance. \r\nNotice of Claim: To Prime Contractor on or before the fifteenth day of the second month following each month of delivery of material or performance of work. \r\nAdditional Notice Specially Fabricated Goods: To Prime Contractor on or before fifteenth day of second month after receipt and acceptance of order. {TGC 2253.047}.', 'Notice of Nonpayment and statement of Account: To Prime Contractor &amp; Surety accompanied by a sworn statement of account on or before the fifteenth day of the third month following each month in which there was performance. {TGC § 2253.041}. \r\nNotice of Claim for Retainage: To Prime Contractor and Surety on or before 90th day after final completion of contract (not required if amount claimed as part above Notice). {TGC § 2253.046}.', 'Not Available', 'File suit not more than 1 year after date of giving notice. {TGC 2253.078}.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(35, 44, 2, 'Stop Notice &amp; Lien on Unexpended Funds where prime contract for  25,000.00 or less & no bond is required.', 'Subcontractor, Materialman', 'Not Required', 'Notice of Lien on Money (Public Project): To Prime Contractor & Public Authority not later than fifteenth day of the second month following each month in which labor was performed or material furnished but before such contractor is paid. {TPC § 53.232-.239}', 'Not Available', 'Not Available', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(36, 44, 2, 'Suit on Bond Posted to remove Lien on Unexpected Funds', 'Subcontractor, Materialman', 'Not Required', 'Not Required', 'Not Available', 'File suit within 6 months after date on which Bond is filed. {TPC 53.239}.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(37, 1, 2, 'Payment Bond equal to or greater then 50% of contract amount for contracts $50,000.00 or more.', 'Not Required', '45 Day Bond Claim Notice: To Contractor and Surety, via registered mail (return receipt requested) 45 days before suit is filed. Notice MUST contain amount claimed and nature of the claim.§39-1-1(b)         NewspaperAd : Contractor must place an ad, whlch states completlon ofcontract, Ina newspaper In clty orcountyof work for 4 weeks lmmedlately after completlon of contract OR, post Notlce ofCompletlon of ContFact at COUrth0USe foF 30 days. §39-1-1(f)', '', 'Lien is available on unpaid funds owned by public entity to general contractor. This remedy is available to subcontractors and suppliers under the same procedures for Private Works. Lien does not extend to real estate, but only such unpaid balance. Martin v. High 145 So.2d 491(1933)', 'File 45 days after notice of Claim and within 1 year from date of final settlement of contract. §39-1-1(b)', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(38, 1, 2, 'Lien on Public Funds Owing to General Contractor', 'Subcontractor, Materialman', 'May give Preliminary Notice to owner and any mortgagee of intent to furnish specified materials at specified prices. Owner may refuse to accept lien by giving notice of such refusal to furnisher in writing before material is used. Preliminary Notice is necessary to preserve full lien rights. Statutory form for Preliminary Notice is provided. If Preliminary Notice is not given, the lien is limited to unpaid balance owing from owner to contractor.', 'If no Preliminary Notice given to owner and any mortgagee, Notice of Claim must be given to owner and any mortgagee before recording. Notice must set forth the amount of the claim and for what and from whom it is owing. It is presently unsettled if this notice is mandatory.', 'Verified Statement of Lien: Must be filed within 4 month of last performance. (Laborers: within 30 days). Statutory form for lien provided.', 'Suit mist be commenced within 6 month after maturity of entire debt.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(39, 1, 1, 'Mechanics\' Lien . . . . §35-11-210, et seq. Lessor\'s Lien . . . . §35-11-430 (Equipment rental)', 'Original Contractor', 'Not Required', 'Not Required', 'Verified Statement of Lien: Filed within 6 month of last performance. §35-11-213, §35-11-215', 'Commenced within 6 months after maturity of entire debt. §35-11-221', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(40, 1, 1, 'Mechanics\' Lien . . . . §35-11-210, et seq. Lessor\'s Lien . . . . §35-11-430 (Equipment rental)', 'Subcontractor, Materialman, Laborer, Lessor of Machinery and Equipment (Foreign corporations not qualified to do business in Alabama may not enforce a lien in Alabama courts.)', 'Preliminary Notice: To owner and Mortgagee before labor or material are furnished to job site. Preliminary Notice MUST list materials and its full price. Owner may object by giving written notice to materialman before material is used. If Preliminary Notice is not given, Lien is limited to unpaid balance.  §35-11-210', 'Notice Of Intent to File a Lien Claim : If no Preliminary Notice given, Send Notice of Lien to Lien to owner and Mortgagee before filing the Lien . NotiCe MUST 1 ist the am0Unt of the claim, the materials or labor, the proiect, and who owes the money §35-11-218', 'Verified Statement of Lien: Filed within 4 month of last performance of work or furnishing of material. (Laborers: within 30 days). §35-11-215. Materialman, that has given Preliminary Notice, is considered an original contractor, and must file a verified statement of lien within 6 month of last performance.', 'Commenced within 6 month after maturity of entire debt. §35-11-221', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(41, 1, 1, 'Mechanics\' Lien -On Improvements on Public Street by Private Owner of Adjoining Property; Amount > $100', 'Original Contractor, Subcontractor, Materialman', 'Not Required', 'Not Required', 'Verified Statement of Lien: Filed with judge of Probate of County of property being liened within 6 month of last performance of labor or furnishing of \"any material\". §35-11-412', 'Commenced within 6 month after maturity of entire debt. §35-11-412', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(42, 2, 1, 'Mechanics\' Lien', 'General Contractor, Subcontractor, Materialman,Equipment Supplier, Architect/Engineer', 'Notice of Right to Lien: Before performance,record and give Notice of Right to lien, to owner and construction lender. Notice MUST contain statutory language.', 'Not Required', 'Claim of Lien: Record lien within 90 days after last performance if owner does not file Notice of Completion. Otherwise within 15 days after Notice of Completion is recorded.', 'File suit within 6 month after date lien filed, unless extension (allows for additional 6 months) is filed within 6 month period. Only one extension is allowed.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(43, 4, 2, 'Religious or charitable organizations; Suite on Payment Bond-bond minimum 100%; contracts over $1,000.00', 'Subcontractor, Materialman', 'Not Required', 'Not Required', 'Available for unpaid amount of claim if bond is not filed with County Recorder of Deeds.', 'File suit within 6 months from final payment', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(44, 6, 1, 'Mechanics\' Lien', 'Any Lien Claimant', 'Permissive written disbursing agent notice of intended performance & estimated amount due for said work to owner, lender or other disburser of construction funds (excludes principal contractor). Statute imposes trust fund on all funds disbursed to any contractor or', 'Not Required', 'Not Available', 'Not Available', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(45, 6, 2, 'Contracts over $50,000.00 Suit on Payment Bond', 'Contractor, Subcontractor, Materialman, Laborers', 'Not Required', 'Not Required', 'Not Available', 'Within 6 months after substantial completion of project or 90 days after date of final settlement, whichever is later. If bond provides for longer period bond controls.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(46, 2, 2, 'Suit on Payment Bond which is required on all contracts exceeding $100,000.00*', 'File suit within 6 month after date lien filed, unless extension (allows for additional 6 months) is filed within 6 month period. Only one extension is allowed.', 'Not Required', 'Not Required', 'Not Available', 'File suit not less than 90 days after performance nor more than 1 year after final settlement of prime contract.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(47, 2, 2, 'Suit on Payment Bond which is required on all contracts exceeding $100,000.00*', 'Second Tier Subcontrator Materialman -not in privity With bonded Contractor, but with first-tie subcontractor', 'Not Required', '90 Day Bond Claim Notice: Written Notice of Claim to bonded Contractor within 90 days after last performance by registered mail ( return receipt requested )', 'Not Available', 'File suit not less than 90 days after performance nor more than 1 year after final settlement of prime contract.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(48, 3, 1, 'Mechanics\' Lien; Stop Notice', 'Contractor, Engineer,Surveyor, Architect(Original Contractors,A.R.S. §33-992.01) No lien if contract, payment bond & legal description recorded -- claim & suit on bond.A.R.S. §33-1003', 'Arizona Preliminary 20 Day Lien Notice (Private): Notice(Statutory Form) to owner, contractor, construction lender & person with whom claimant has contracted within 20 days of first performance. A.R.S. §33-992.01 Claimants who provide such notice must be provided copies of Notice of Completion within 10 days of recording thereof.', 'Verified \"Stop Notice\" or \"Bonded Stop Notice\" (if to construction lender) to Owner and construction lender, if any. Such notice obliges owner or lender to withhold from prime contractor monies equal to claim. Owner is not required to hold funds exceeding balance due on contract. A.R.S. §33-1002 Upon demand by Owner or Lender, claimant must either furnish stop notice within 30 days of demand, or forfeit lien rights A.R.S. §33-1054', 'Notice and Claim of Lien: Record lien within 120 days after project completed. If Notice of Completion recorded, then record lien within 60 days. A.R.S. §33-993  To record: Attach to notice and claim of lien: 1) Copy of 20 day notice 2) Mailing affidavit or certified mail receipt 3) Construction contract', 'File suit within 6 months after lien is recorded. A.R.S. §33-998', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(49, 3, 1, 'Mechanics\' Lien; Stop Notice', 'Subcontractor,Materialman No lien if contract, payment bond & legal description recorded -- claim & suit on  bond. A.R.S. §33-1003 *Note: construction lenders have priority over lien claimants, if the mortgage or trust deed securing the loan is recorded within 10 days after first work or furnishing of materials.', 'Arizona Preliminary 20 Day Lien Notice (Private): Notice (Statutory Form) to Owner, Contractor, Subcontractor Construction Lender and person with whom claimant has contracted, within 20 days of first performance.', 'Not Required', 'Record lien within 120 days after project completed. If Notice of Completion recorded, then record lien within 60 days. A.R.S. §33-993', 'File suit within 6 months after lien recorded.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(50, 3, 2, 'Suit on Payment Bond - bond minimum 100%', 'Subcontractor, Materialman Privity of contract with subcontractor but not with the prime contractor.', 'Arizona Preliminary 20 Day Lien Notice (Public Project): Notice to Owner, Contractor, Subcontractor, Construction Lender & person with whom claimant has contracted, within 20 days of first performance. A.R.S. §34-222', '90 Day Notice to Contractor: Written Notice of Claim to Contractor within 90 days after last performance (registered or certified mail, return receipt requested). Federal Miller Act by registered mail. A.R.S. §34.223.A', 'Not Available', 'File suit not less than 90 days after last performance or more than 1 year from last performance. A.R.S. §34-223. B', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(51, 4, 1, 'Mechanics\' Lien', 'Contractor', 'Preliminary Notice to Owner: Must furnish the owner a specific acknowledgement notice before furnishing materials or labor, sent by stipulation or certified mail per AR. Code Ann. Sec. §18-44-115.', 'Not Required', 'Verified Statement of Account and Claim of Lien: Record lien within 120 days after last performance. §18-44-117', 'File suit within 15 months after lien filed.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(52, 4, 1, 'Mechanics\' Lien', 'Subcontractor, Materialman; Note : Rights available limited to second tier subcontractors and their suppliers, but not lower tiers', 'Written notice to owner of reservation of right to file lien for materials, before performance · ( N 0 notice requiFements follie ? 50 ? raiIFOad property )', 'Notice Of Intent to Filea L ien Claim : Written notiCe to OWner of intent to file lien 10 days before filing lien.  §18-44-114', 'Veriified Statement of Account and Claim of Lien : Record lien Within 120 days after last performance . ( No Lien filling requirement for liens on railroad property )', 'File Suit Within 15 months after lien filed . ( Railroad Property is one year, not 15 months ) §18-44-403', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(53, 4, 2, 'Suite on Payment Bond -bond minimum 100%; contract over $20,000', 'Subcontractor, Materialman', 'Not Required', 'Not Required', 'Not Available', 'File suite within 6 months after final payment on the contract per AR. Code Ann. Sec. §18-44-508 & §22-9-403. This time period may be extended to 12 months from the date final payment is made for contracts with the Arkansas Sate Building Services per AR. Code Ann. Sec. §18-44-503(b).', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(54, 6, 1, 'Mechanics\' Lien', 'Every person who performs labor or furnishes material used in construction of improvements. Submaterialmen are NOT entitled to a lien. An affirmative defense is available to owners who pay a higher-tier party on certain residential projects up to 4 units.', 'Written notice from owner: (This is the owner\'s remedy to avoid liens) within 5 days of notice to remove property interest from being subject to liens.', 'Verified Notice to Disburse Direct: Sent to party disbursing funds as long as funds remain to be paid on the project. §38-22-126  Disburser\'s Notice: At time of shipment, and sent to party disbursing the fonds.   Notice Of Intent to File Lien Statement : Written Notice ( personal Service registered or certified mail, return receipt requested) of Intent to File a lien to Owner & GeneFal Contractor at least 10 days prior to recording of Lien Statement §38-22-109(3)', 'Not Available', 'At any time after performance but not more than 30 days + 6 months after Notice of Completion is recorded or not more than 90 days + 6 months after actual completion or acceptance of the project if no such notice is given. CC §3249', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(55, 24, 2, 'Suit on Payment Bond - minimum 100%', 'Subcontractor, Materialman, Sub-subcontractor', 'None Required', 'Written notice of claim to contractor & surety within 120 days after last performance.', 'Not Available', 'File suit within 1 year of last delivery of labor & materials to the project.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(56, 25, 1, 'Mechanics\' Lien', 'Contractor (Only General Contractor has Mechanics\' Lien rights.)', 'Not Required', 'Not Required', 'Claim of Lien: No deadline, but see time for filing suit. Suit effective only from filing against subsequent lienors. Should file suit as soon as possible, along with copy of contract.', 'File suit within 12 months after date debt is due.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(57, 25, 1, 'Private Bond (Bond optional on private project)', 'Subcontractor & Materialman to Prime Contractors', 'Not Required', 'Not Required', 'Not Required', 'File suit within 1 year from written acceptance by owner or actual occupancy, whichever occurs first.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(58, 25, 2, 'Suit on Payment Bond - No minimum amount', 'Subcontractor', 'Not Required', 'No notice required to be given to prime or surety.', 'Not Available', 'File suit within 1 year from written acceptance by owner or actual occupancy, whichever occurs first.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14');
INSERT INTO `lien_bound_summaries` (`id`, `state_id`, `project_type_id`, `rights_available`, `claimant`, `prelim_notice`, `other_notice`, `lien`, `suit`, `notes`, `created_at`, `updated_at`) VALUES
(59, 6, 2, 'Claim Against Unexpected Funds', 'Contractor, Subcontractor, Materialman, Laborers', 'Not Required', 'Verified Statement of Amount Dee/Lien On Funds ( Public Project ): file With Owner/Public Authority and time up to final Settlement of proiect.', 'Not Available', 'File Suit Within 6 months of substantial completion of project or 90 days after date of final settlement, Whichever is later. Lis Pendens required to be served on government entity.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(60, 7, 1, 'Mechanics\' Lien', 'Contractor, Subcontractor (if contract is signed or assented to in writing by owner)', 'Not Required', 'Original contractor can record lien without prior service of Notice of Intent.', 'Record lien within 90 days after last performance. Serve copy on owner no later than 30 days after recording lien.', 'Filed & Notice of Lis Pendens to be recorded within 1 year of date lien was recorded. Lien to be foreclosed in same manner as mortgage. Lien is discharged as a matter of law if foreclosure suit is not filed within 1 year of recording.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(61, 7, 1, 'Mechanics\' Lien', 'Subcontractor (if contract is not signed or assented to in writing by owner)', 'Not Required', 'Notice of Intent to File Lien: Served upon owner (and original contractor if he has lodged an affidavit stating the name under which he does business, his business address & a description of the subject premises within 15 days of his commencing performance) by a sheriff or other disinterested person within 90 days of last  performance.', 'Not Available', 'Not Available', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(62, 7, 2, 'Suit on minimum 100% Payment Bond for contracts over $50,000.00', 'Subcontractor, Materialman', 'Not Required', '180 Day Notice of Claim on Bond - Public Project: - If payment is not made within 60 days of applicable payment date: to Surety and the Principal. - If work included a requisition: serve within 180 days of payment date set by statute. CGS 49-41a(a). - If work not included in requisition: serve within 180 days of last performance.', 'Not Available', 'File suit within 1 year after last performance.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(63, 7, 2, 'Escrow Account For Retention', 'Subcontractor, Materialman', 'Not Required', 'If owner makes payment to general contractor and general contractor does not in turn pay subcontractors within 30 days of the payment, subcontractor may give registered mail Notice of Claim to general contractor. After 10 days, general contractor is liable for 1%/month interest and may be required to escrow in an interest bearing account the amount due plus 1% interest.', 'Not Available', 'Not Available', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(64, 9, 1, 'Mechanics\' Lien', 'Contractor, Laborer', 'Not Required', 'Notice of Mechanics\' Lien: File Notice of Intention with Recorder of Deeds anytime during construction or within 90 days after last performance, unless otherwise stated in the contract. Can file notice whether claim is due or not. D.C. Code Ann. §38-101 and §38-102 (1990 Repl. Vol.)', 'File Notice of Intention with Recorder of Deeds anytime during construction or within 90 days after last performance, unless otherwise stated in the contract \"At the time of filing.\"', 'Any person entitled to a lien may commence suit at any time within 180 days from & after the filing notice of last performance, unless his claim is not due at the expiration of said periods, in which case, the action must be commenced within 3 months of said claim becomes due. §40-303.13', 'In order to file a Notice of Lien a Contractor, Laborer, Subcontractor or Materialman may be\nrequired to file copies of licenses and certificates of good standing. Obtaining these certificates may\nrequire a signigicant amount of time, so local counsel must be allowed an adequate amount of time\nCorporation Office and a copy of the written work agreement signed by both parties. Therefore, a\ncompany must first be registered as a foreign or domestic corporation in the district. Moreover, obtaining\nthese certificates takes a significant amount of time. If there is no written agreement to perform the work\nor supply the materials, no lien rights exist. §40.301.02', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(65, 9, 1, 'Mechanics\' Lien', 'Subcontractor', 'Not Required', 'Notice of Subcontractor\'s Mechanic\'s Lien: Must serve notice upon owner of the property on which lien is claimed. Subcontractor is also entitled to know the terms of Prime Contract, including amount due or to become due to the contractor. D.C. Code Ann. §38-103, §38-104,§38-105, §38-107 (1990 Repl. Vol.)', 'Record lien in the Office of the Recorder and Serve upon Owner anytime during performance or within 90 days completion unless otherwise stated in contract. \"At the time of filing.\" Subcontractor\'s lien is limited to amount to become to Original Contractor, D.C. Code §38-103, §38-104,§38-105', 'Any person entitled to a lien may commence suit at an time within 180 days from & after the filing notice of last performance, unless his claim is not due at the expiration of said periods, in which case, the action must be commenced within 3 months of said claim becomes due. §40-303.13', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(66, 9, 2, 'Bond Claim', 'Subcontractor (1st-Tier)', 'Not Required', 'Not Required', 'Not Available', 'Must file suit between 90 days & 1 year after last performance.', 'No bond is required for contracts less than $25,000 D.C. Code §1-1107', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(67, 9, 2, 'Bond Claim', 'Sub-subcontractor, Materialman', 'Not Required', 'Notice of Claim on Bond: Notice to principal contractor within 90 days after last work done or material furnished or supplied by that claimant must state with substantial accuracy the amount claimed and name of party to whom material or labor was supplied. Must serve notice by registered mail, postage prepaid, to contractor\'s address, or by original service of process method. D.C. Code § 1-1105 (1992 repl. Vol.)', 'Not Available', 'Must file suit between 90 days & 1 year after last performance or last supply of material by claimant.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(68, 8, 1, 'Mechanics\' Lien Value over $25.00', 'Contractor who has contract directly with the owner & has furnished both labor & materials.', 'Not Required', 'Not Required', 'Statement of Claim: File within 180 days after completion of project. 25 Del.C. §2711(a)', 'File within time limits for lien. Personal action can be included within claim. SUIT File within time limits for lien. Personal action can be included within claim. 1 & 4', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(69, 8, 1, 'Mechanics\' Lien Value over $25.00', 'All other persons who have performed or furnished labor or material, or both.', 'Not Required', 'Not Required', 'Statement of Claim: File lien within 120 days after completion of labor or last delivery of material.', 'File within time limits for lien. Personal action can be included within claim. SUIT File within time limits for lien. Personal action can be included within claim. 1 & 4', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(70, 8, 1, 'Mechanics\' Lien Value over $25.00', 'Any person performing labor under $100 may file in Justice of the Peace Court.', 'Not Required', 'Not Required', 'Statement of Claim : File lien not sooner than 20 days after last labor performed but within 30 days after last performance . 25 Del.C.§2732.', 'File within time limits for lien. Personal action can be included within claim. SUIT File within time limits for lien. Personal action can be included within claim. 1 & 4', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(71, 12, 2, 'Suit on Payment Bond - bond minimum 50%', 'Subcontractor, Materialman, Laborer', 'Not Required', 'Notice to Contractor and Surety within 90 days of last furnishing.', 'Not Available', 'File suit not less than 90 days after claimant\'s performance or more than one year from completion of work on entire project.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(72, 17, 1, 'Mechanics\' Lien', 'Contractor', 'Not Required', 'Not Required', 'Contractor\'s Lien Statement: Record lien within 4 months after last performance. Serve copy of lien on owner by certified or registered mail, return receipt requested. If owner\'s address is unknown, post a copy of the lien in a conspicuous place. K.S.A. §60-1102', 'File suit within 1 year after lien is filed.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(73, 8, 2, 'Payment bonds required for virtually all public work projects; Mechanics\' Lien available in certain limited circumstances.', 'Subcontractor,Materialman', 'No special statutory provisions for notice.', 'No special statutory provisions for notice.', 'Comply with timelines for private projects.', 'File if bond so provides, within 1 year of bidder\'s last work; otherwise, within 3 years of last work on contract. 29 Del. Code. §6927', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(74, 11, 1, 'Mechanics\' Lien', 'Contractor, Land Surveyor, Professional Engineer, Architect, Landscape Architect, Materialman', 'Notice of Commencement: With Clerk of Superior Court in the County where the project is located, within 15 days of work commencing. §44-14-361.5(b)', 'Not Required', 'Claim of Lien: Record within 3 months of providing last material or labor, etc., and simultaneously send copy of lien to Owner, or General Contractor as agent of Owner, by registered or certified mail. §44-14-361.1(a)', 'File within 12 months of date when claim became due, which is the last date of work as identified by mechanics\' lien. Notice of Institution of Suit against Debtor for Recovery of Debt: with clerk of the superior court where the lien was filed within 14 days of date suit was filed.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(75, 11, 1, 'Mechanics\' Lien', 'Subcontractor, Sub-subcontractor, Materialman, Laborer', 'Notice to Contactor (Private Project): -In privity w/General Contractor: optional Preliminary Claim of Lien filed within 30 days of first delivery of any labor, services or materials. §44-14-361.5(c) - Not in Privity w/General Contractor: Mandatory Notice to Contractor and Owner within 30 days of first delivery of any labor, services or materials. §44-14-366.5(c)', 'Not Required', 'Claim of Lien: Record within 3 months of providing last material or labor, etc., and simultaneously send copy of lien to Owner, or General Contractor as agent of Owner, by registered or certified mail. §44-14-361.1(a)', 'File within 12 months of when the debt becomes due. Must sue party owing claimant & obtain judgment before enforcing lien against landowners (there are several exceptions allowing suit directly against landowner without first obtaining judgement against party owing debt). May file suit against both lien and debt simultaneously for greater protection (only if obligor and owner are in same county). Notice of Institution of Suit: With clerk of the superior court where the lien was filed within 14 days after filing suit.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(76, 11, 2, 'On all contracts requiring bond mandatory for $100,000.00 or more optional below. -Local Govern Liens may require bonds when contract price is less than $100,000.00 -Georgia Dot require bonds > $50K', 'Subcontractor, Materialman to Contractors (suppliers to subs only if provided in the bond).', 'Notice to Contractor (Public Project): To Contractor by 2nd tier claimant: - If General Contractor files Notice of Commencement [36-82- 104 (f)] - send Notice within 30 days from filing of Notice of Commencement or 30 days following 1st delivery of labor, material, machinery or equipment,  whichever is later. Preliminary Notice NOT required for 1st Tier Claimants.', 'Notice to Contractor (Public Project): To Contractor by 2nd tier claimant: indicating type of materials delivered and the amount being claimed, within 90 days of last material or labor delivery. Notice to contractor requires specific information, and sent by certified or registered mail.', 'Not Available', 'File within 1 year of completion & acceptance of project.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(77, 12, 1, 'Mechanics\' Lien', 'Contractor, Subcontractor, Materialman, Laborer', 'Not Required', 'Not Required', 'Application For Mechanic\'s and Materialman\'s Lien & Notice of Mechanics\' & Materialman\'s Lien & Demand for Payment: Application & Notice must be filed with Circuit Court where property is located within 45 days after the affidavit that certifies publication of the Notice of Completion is filed, with copies served upon others with an interest in the property and the contracting party.', 'File suit within 3 months after Order Directing Lien to attach is entered.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(78, 13, 1, 'Mechanics\' Lien - Retainage cannot exceed 5%. Final release of retainage may be conditioned upon delivery of lien waivers from all potential claimants.', 'Contractor', 'Not Required', 'Disclosure to residential property Owner/Buyer Idaho Statutes §45-525 Effective 7/1/02', 'Claim of Lien: Record lien within 90 days after substantial completion of labor or services or furnishing of materials. Must give notice to owner by certified mail within 5 days of recording lien. Idaho Statute §45-507 Revised eff. 7/1/02', 'File suit within 6 months after lien is filed.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(79, 13, 1, 'Mechanics\' Lien - Retainage cannot exceed 5%. Final release of retainage may be conditioned upon delivery of lien waivers from all potential claimants.', 'Subcontractor, Materialman', 'Not Required', 'Not Required', 'Claim of Lien: Record lien within 90 days after substantial completion of labor or services or furnishing of materials. Must give notice to owner by certified mail within 5 days of recording lien. Idaho Statute §45-507 Revised eff. 7/1/02', 'File suit within 6 months after lien is filed.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(80, 13, 2, 'Mechanics\' Lien - Suit on Payment Bond - bond minimum 85%, where bond is for more than 50%, Retainage cannot exceed 5%.', 'Subcontractor', 'Not Required', 'Not Required', 'Not Available', 'File suit not less than 90 days from last performance or more than 1 year after final payment was due under the subcontract. File suit not less than 90 days or more than 1 year after last performance.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(81, 13, 2, 'Mechanics\' Lien - Suit on Payment Bond - bond minimum 85%, where bond is for more than 50%, Retainage cannot exceed 5%.', 'Third tier Subcontractor & Materialmen', 'Not Required', 'Notice of Claim On Bond : Written Notice of Claim to Contractor within 90 days from last performance. ldaho Statute §54-1927', 'Not Available', 'File suit not less than 90 days or more than 1 year after last performance.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(82, 26, 2, 'Suit on Payment Bond - mandatory bond minimum 100% for contracts over $25,000,00', 'Subcontractor, Materialman', 'Not Required', '(No Statutory Notice requirements, but will uphold any notice requirements in the bond).', 'Not Available', 'File suit within 10 years after completion of work, however, in St. Louis file suit within 90 days after completion of work.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(83, 28, 2, 'Suit on 100% Payment Bond', 'Subcontractor/Supplier (direct contract with General Contractor)', 'Not Required', 'Not Required', 'Not Available', 'Suit to enforce claim: Not earlier than 90 days from claimants final date of furnishing, but within 1 year of final settlement of principal contract. §§ 52-118.01 & 52- 118.02', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(84, 15, 1, 'Mechanics\' Lien', 'Original Contractor', 'Not Required', 'Not Required', 'Record lien within 90 days (for contracts and subcontracts entered into after June 30, 1999) after last performance furnished; except for single or double family dwelling units (IC 22-12-1-5) in which case the lien must be filed within 60 days after performing labor or furnishing materials or machinery. As to contracts and subcontracts entered into prior to June 30, 1999, lien shall be recorded within 60 days after last labor or materials furnished.', 'File suit within 1 year after lien recorded or within 30 days of notice from owner or interest holder to commence suit. IC §32-8-3-6.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(85, 15, 1, 'Mechanics\' Lien', 'Subcontractor, Materialman, Lessor of Equipment, Laborer 1&4', 'For Single or Double family dwelling units Preliminary Notice of Furnishing Materials, Labor or Machinery must be served within 30 days from first performance for alterations or repair work; within 60 days from first day of performance for original or new construction. IC §32-8-3-1', 'Not Required', 'Record lien within 90 days (for contracts and subcontracts entered into after June 30, 1999) after last performance furnished; except for single or double family dwelling units (IC 22-12-1-5) in which case the lien must be filed within 60 days after performing labor or furnishing materials or machinery. As to contracts and subcontracts entered into on prior to June 30, 1999, lien shall be recorded within 60 days after last labor or materials furnished.', 'File suit within 1 year after lien or within 30 days of notice from owner to commence suit. IC §32-8-3-6', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(86, 15, 1, 'Personal Liability of Owner (Lien on Retainages)', 'Subcontractor, Materialman, Lessor of Equipment, Laborer', 'Written Notice of Indebtedness creates lien on any retainages or contract monies that are due general contractor and owner becomes personally liable to extent of retainage or contract monies, if it does not withhold retainage after receipt of notice.', 'Not Required', 'Not Required', 'Various limitations. Consult counsel immediately upon giving notice.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(87, 15, 2, 'Notice & Suit on 100% Payment Bond (political subdivisions contracts greater than $100,000)', 'Subcontractor, Materialman, Lessor of Equipment, Laborer', 'Not Required', 'Verified Claim on Bond: (2 copies) filed with Public Authority and a copy sent to Surety (local rules must be checked for filing requirements) within 60 days after last performance and not later than 30 days after final acceptance and completion of project.', 'Not Available', 'File suit not less than 30 days after Notice of Claim on Bond. Not more that 60 days after final completion and acceptance of project.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(88, 15, 2, 'Lien on Contract- Monies Due', 'Subcontractor, Materialman, Laborer', 'Not Required', 'Verified Claim On Bond: (2 copies) Filed With Public Authority and a copy Sent to Surety (local rules must be checked for filling requirements ) within 60 days after last performance and not later than 30 days after final acceptance and completion of project.', 'Not Available', 'File Suit not less than 30 days after Notice of Claim on Bond . Not more that 60 days after final completion and acceptance of proiect.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(89, 15, 2, 'Notice & Suit on Payment Bond', 'Subcontractor, Materialman, Laborer', 'Not Required', 'Verified Claim on Bond: (3 copies) filed with Public Authority within 60 days after last performance and not later than 30 days after final acceptance and completion of project. IC 8-23-9-26 and 27.', 'Not Available', 'Suit must be filed within 90 days of Notice of Rejection of Claim from the IN DOT. Claimant MUST file a copy of certificate from clerk of the court with the state within same 90 day period.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(90, 16, 1, 'Mechanics\' Lien', 'Original Contractor', 'Contractor\'s Notice to Owner to file a lien for subcontractor\'s work: - If Owner Occupied Dwelling: To Owner in written contract, or if no written contract, then in writing within 10 days of commencement of work. §572.13 - If Commercial Work: Not applicable. Iowa Code §572.13.', 'Not Required', 'Verified Mechanics\' Lien Statement: Record lien within 90 days after last performance. Iowa code §572.9. If recorded after ninety days, may lose priority. Iowa Code §572.18.', 'File suit within 2 years after the expiration of the 90 day period within which lien must be filed. Iowa Code §572.27.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(91, 16, 1, 'Mechanics\' Lien', 'Subcontractor, Materialman', 'Subcontractor\'s Notice to Owner if owner occupied dwelling: Anytime after first performance but before final payment to original contractor. Iowa Code §572.14.', 'Not Required', 'Verified Mechanics\' Lien Statement: Record lien within 90 days after last performance. Iowa Code § 572.9. Notice of Lien to Owner: If recorded after the 90 day period the lien is perfected to the extent of balance due & owing prime contractor by filing the claim with the clerk & serving written notice on owner. Iowa Code § 572.10-11.', 'File suit wthin 2 years after the expiration of the 90 day period within which the lien must be filed. Iowa Code §572.27. Owner or Contractor demand for suit by lien holder requires a suit be filed within 30 days, or lien shall be forfeited. Iowa Code §572.28.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(92, 16, 1, 'Mechanics\' Lien', 'Sub Subcontractors, Lower Tier Matieralman', 'One time notice to general contractor within 30 days of first furnishing material or labor. Iowa Code §572.33.', 'Not Required', 'Verified Mechanics\' Lien Statement: Record lien within 90 days after last performance. Iowa Code § 572.9. Notice of Lien to Owner: If recorded after the 90 day period the lien is perfected to the extent of balance due & owing prime contractor by filing the claim with the clerk & serving written notice on owner. Iowa Code § 572.10-11.', 'File suit within 2 years after the expiration of the 90 day period within which the lien must be filed. Iowa Code §572.27. Owner or Contractor demand for suit by lien holder requires a suit be filed within 30 days, or lien shall be forfeited. Iowa Code §572.28', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(93, 16, 2, 'Suit on Payment Bond', 'Subcontractor, Materialman, Supplier (A Materialman selling to a materialman is not entitled to a claim.) Iowa Code §573.7', 'Materialman, Supplier performing no job site labor & selling to a sub who is performing job site work, give notice to principal contractor w/in 30 days of 1st furnishing of material or by furnishing itemized invoices to principal contractor during work relative to those materials. Claim must be supported by certified statement that notice was given. For full protection notify prime contractor w/in 30 days after each delivery. Iowa Code §573.15', 'Notice of Claim (Public Project): Written Notice of Claim to Public Authority within 30 days after completion & final acceptance of project; if written notice is given after 30 days, it only covers the unpaid portion of the contract, if any. Iowa Code §573.10', 'Not Available', 'File suit not less than 30 nor more than 60 days after completion & final acceptance of the project. Iowa Code §573.16', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(94, 17, 1, 'Mechanics\' Lien', 'Subcontractor, Materialman', 'Residential before performance; Warning statement: K.S.A. §60-1103a', 'Notice of Intent to Perform: To clerk of Court of county of property prior to recording deed transferring title to new Owner. (refers to residential property) K.S.A. §60-1103b(c)', 'Subcontractor\'s Lien Statement: Record lien within 3 months after last performance. The claimant shall (1) cause a copy of the lien statement to be served personally upon any one owner, any holder of recorded equitable interest and any party obligated to pay the lien in the manner provided by K.S.A. 60-304, and amendments, for service of summons within the state, or by K.S.A. 60-308 and amendments for service outside the state, (2) Mail a copy of the lien statement to any one owner of the property, any holder of recorded equitable interest and to any party obligated to pay the same by restricted mail, or (3) if the address of any one owner or such party is unknown and cannot be ascertained with reasonable diligence, post a copy of the lien statement in a conspicuous place on the premises. See K.S.A. 60-1103', 'File suit within 1 year of filing lien statement. If promissory note attached to lien statement instead of itemized statement, MUST file suit within 1 year of date note becomes due.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(95, 17, 2, 'Suit on Payment Bond - bond minimum 100%', 'Subcontractor, Materialman', 'No special statutory provisions for notice or suit.', 'Not Required', 'Not Available', 'File suit within 6 months after completion of project.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(96, 18, 1, 'Mechanics\' Lien & Materialman\'s Lien', 'Contractor, Engineer, Land Surveyor or other person who has contracted directly with Owner or Owner\'s Agent', 'Optional: Statement of Intent may be filed with County Clerk, (gives priority over subsequent mortgage, lien or conveyance).', 'Not Required', 'Lien Statement: MUST be filed in County Clerk\'s office within 6 months after ceasing to furnish labor or materials. Copy mailed to owner within 7 days of filing.', 'File suit within 12 months of filing of Statement of Lien.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(97, 18, 1, 'Mechanics\' Lien & Materialman\'s Lien', 'Subcontractor, Materialman and other persons who have not contracted directly with Owner or Owner\'s Agent', 'Statement of Intent may be filed with County Clerk (optional - gives priority over subsequent mortgage, lien or conveyance).', 'Notice to Owner: If amount of claim is less than $1,000.00, written notice must be given to owner within 75 days after last item of material or labor is furnished. If amount of claim is greater than $1,000.00, written notice must be given to owner within 120 days after last item of material or labor is furnished. K.R.S. §376.010', 'Lien Statement: MUST be filed in County Clerk\'s office within 6 months after ceasing to furnish labor or materials. Copy mailed to owner within 7 days of filing.', 'File suit within 12 months of filing of Statement of Lien.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(98, 18, 1, 'Mechanics\' Lien & Materialman\'s Lien', '* All persons who have not contracted directly with owner-occupant or his authorized agent.', 'Statement of Intent may be filed with County Clerk (optional - gives priority over subsequent mortgage, lien or conveyance).', 'Owner MUST be given notice in writing not more than 75 days after last item of material or labor is furnished. K.R.S. §376.080  · Lien not available to extent owner has previously paid.', 'Lien Statement: MUST be filed in County Clerk\'s office within 6 months after ceasing to furnish labor or materials. Copy mailed to owner within 7 days of filing.', 'File suit within 12 months of filing of Statement of Lien.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(99, 18, 1, 'Property owned by State, any subdivision or agency thereof, or by any county, urban county, or city - Lien on Funds Due Contractor', 'Subcontractor, Materialman', 'Preliminary Notice (Public Project): Statement of Intent (optional - gives priority from date of filing).', 'Not Required', 'Lien Statement (Public Project): MUST be filed in County Clerk\'s office of the county where the seat of government of the owner of the improved property lies within 30 days after the last day of the month in which labor or materials were supplied. Perfect lien by filing with Public Authority making the contract for improvement, an attested copy of the Lien Statement, a signed copy of a letter addressed to the debtor, contractor, or subcontractor, and a post office receipt showing that an attested copy of Lien Statement has been sent to the contractor or subcontractor by the lien claimant by certified mail, return receipt requested or registered mail. K.R.S. §376.30', 'If contractor protests filing of lien within 30 days, suit must be instituted and summons served on the Public Authority within 30 days of protest of filing. If contractor does not protest and does not pay, file suit within 6 months after filing statement of lien.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(100, 18, 2, 'Public Improvement not owned by State, City or County-Lien upon all property and franchises of owner - Lien on Funds Due Contractor', 'Contractor, Subcontractor, Materialman', 'Statement of Intent (optional - gives priority from date of filing).', 'Not Required', 'Lien Statement (Public Project): MUST be filed in County Clerk\'s office of each county in which labor, material or supplies were furnished within 30 days after the last day of the last month in which labor or materials were supplied. K.R.S. §376.230', 'File suit within 6 months of last performance.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(101, 18, 2, 'Public Bond Claim', 'Subcontractor, Materialman', 'Not Required', 'Provided notice in the manner of time specified by the bond.', 'Not Available', 'File suit within time specified on the bond.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(102, 19, 1, 'Mechanics\' Lien', 'General Contractor', 'Notice of Contract: For contracts in excess of $25, 000.00 must be properly and timely recorded before work begins, or G.C. has no right to lien. L.R.S. 9:4811.', 'Not Required', 'Statement of Claim: Record within 60 days of Notice of Termination or substantial completion.', 'File suit within 1 year or the end of the lien filing period.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(103, 19, 1, 'Mechanics\' Lien', 'Subcontractor', 'Not Required', 'Request for Notices: To owner prior to owner\'s recording of Notice of Termination, substantial completion, or abandonment. (Requires Owner give notice to subcontractor of the filing of termination, substantial completion, or abandonment within 3 days of same).', 'Statement of Claim: - Prime Contract recorded: Record within 30 days after Notice of Termination or substantial completion. - Prime Contract not recorded: Within 60 days after owner files Notice of Termination, substantial completion or abandonment. -If suit brought prior to Owner\'s Notice of Completion or default: Record lien and wait 30 days before filing suit. Persons having a direct contractual relationship with subcontractor must file lien to preserve rights.', 'File suit within 1 year or the end of the lien filing period.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(104, 19, 1, 'Mechanics\' Lien', 'Materialman Residential', 'Not Required', 'Notice to Contractor: - No privity with G.C.: To G.C. within 30 days from recording of Notice of Termination. L.R.S. 9:4822(J).', 'Materialman on residential project: Record lien within 70 days of final furnishing.', 'File suit within 1 year after lien filed.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(105, 19, 2, 'Suit on Payment Bond-bond minimum 50% of projects greater than $25,000.00', 'Subcontractor, Materialman', 'Not Required', '', 'Statement of Claim: With Public Authority & record it w/in 45 days of Notice of Acceptance or Contractor Default. L.R.S. 38:2242(B).', 'File suit within 1 year after Public Authority files Notice of Acceptance or of Contractor Default.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(106, 20, 1, 'Mechanics\' Lien', 'Contractor', 'Not Required', 'Not Required', 'Lien Claim Statement: Record lien within 90 days of last performance. Record lien before a bona fide purchaser takes title. §3253, §3255(2)', 'File suit within 120 days of last performance regardless of contract with owner and regardless of whether you are a contractor, subcontractor or materialman. §3255(1)', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(107, 19, 1, 'Mechanics\' Lien', 'Materialman', 'Not Required', 'Request for Notices: To owner prior to owner\'s recording of Notice of termination, substantial completion, or abandonment. (Requires Owner give notice to subcontractor of the filing of termination, substantial completion, or abandonment within 3 days of same). 10-day Notice of Nonpayment: To Owner before filing lien, and on or before 75 days of last day of month that material was delivered or within the statutory lien period, whichever comes first. R.S. 38:2242(F).', 'Statement of Claim: - Prime Contract recorded: Record within 30 days after Notice of Termination or substantial  completion. - Prime Contract not recorded: Within 60 days after Owner files Notice of Termination, substantial completion or abandonment. - If suit brought prior to owner\'s Notice of Completion or default: Persons having a direct contractual relationship with subcontractor must file lien to preserve rights.', 'File suit within 1 year of the end of the lien filing period.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(108, 19, 1, 'Mechanics\' Lien', 'Lessor', 'Copy of Lease: To Owner and Contractor within 10 days of first placement of equipment.', 'Request for Notices: To owner prior to owner\'s recording of Notice of Termination, substantial completion, or abandonment. (Requires Owner give notice to subcontractor of the filing of termination, substantial completion, or abandonment within 3 days of same).', 'Statement of Claim: - Prime Contract recorded: Record within 30 days after Notice of Termination or substantial completion. - Prime Contract not recorded: Within 60 days after owner files Notice of Termination, substantial completion or abandonment.', 'File suit within 1 year after lien is filed.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(109, 19, 2, 'Suit on Payment Bond-bond minimum 50% of projects greater than $25,000.00', 'Subcontractor, Materialman', 'Not Required', 'Notice to Contractor: - No direct contractual relationship with G.C. - to G.C. w/in 45 days after Public Authority files Notice of Acceptance or of Contractor Default. L.R. S. 38:2247', 'Statement of Claim: With Public Authority & record it w/in 45 days of Notice of Acceptance or Contractor Default. L.R.S. 38:2242(B).', 'File suit within 1 year after Public Authority files Notice of Acceptance or of Contractor Default.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(110, 19, 2, 'Suit on Payment Bond-bond minimum 50% of projects greater than $25,000.00', 'Lessor', 'Copy of lease to owner within 10 days of first placement of equipment.', 'Notice to Contractor: - No direct contractual relationship with G.C. - to G.C. w/in 45 days after Public Authority files Notice of Acceptance or of Contractor Default. L.R. S. 38:2247', 'Statement of Claim: With Public Authority & record it w/in 45 days of Notice of Acceptance or Contractor Default.L.R.S. 38:2242(B).', 'File suit within 1 year after Public Authority files Notice of Acceptance or of Contractor Default.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(111, 19, 2, 'Stop Notice on unexpended funds not available, but a subcontractor may have remedy that can be used to attach funds held by the Public  Authority through the use of a civil procedure device under Loui', 'Subcontractor, Materialman', 'Not Required', 'Statement of Claim: With Public Authority & record it w/in 45 days of Notice of Acceptance or Contractor Default.', 'File suit within 1 year after Public Authority files Notice of Acceptance or of Contractor Default.', '', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(112, 20, 1, 'Mechanics\' Lien', 'Subcontractor, MaterialMan', 'Not Required', 'Notice to Owner: Residential property: notice to owner prior to payment of contractor. §3255(3)', 'Lien Claim Statement: Record lien within 90 days of last performance, but in any event before a bona fide purchaser takes title. §3253', 'File suit within 120 days of last performance regardless of contract with owner and regardless of whether you are a contractor, subcontractor or materialman. §3255(1)', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(113, 20, 2, 'Suit on Payment Bond: bond minimum 100% for contracts over $100,000.00', 'Subcontractor, Materialman', 'None Required', 'Notice of Claim (Public Project): If no direct contract with contractor, within 90 days of last performance, send by certified mail, Notice of Claim to contractor on bond claim, otherwise, file lien certificate as with Private Works.', 'Not Available', 'All suits must be filed after 90 days, but within 1 year from last performance. Suit on bond claims must be brought in the county in which the principal or surety has its principal place of business. §871(4).', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(114, 21, 1, 'Mechanics\' Lien (Must be 15% or more of total project §9-102)', 'Subcontractor, Materialman; \"Subcontractor\" means any party with contract with party other than owner; accordingly, tier coverage not limited', 'On single family residential projects Where owner is constructing own residence, any notice given after owner has made payment is ineffective to preserve lien rights, to extent of payments before notice .', 'Notice to Owner Of Intention to Claim a Lien : Within 120 days (90 priorto 10/1/96) of last performance, send by certified mail Notice to Owner of Intent to claim lien ( owner may then withhold funds from contractor for claims). §9-104', 'Not Available', 'File suit to establish lien within 180 days of last performance; attach copy of notice to owner.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(115, 21, 2, 'Payment Bond for contracts over $100,000.00 (contracts between $25,000 - $100,000 may have bond requirements imposed by municipality, not to exceed 50% of contract price). Bond must be in the amount n', 'Subcontractor, Materialman; (tier coverage extends to claimants with contracts with sub-subcontractors)', 'Not Required', 'Notice of Claim on Bond (Public Project): Within 90 days of last performance, written Notice of Claim to principal contractor. §17-108', 'Not Available', 'All suits must be filed within 1 year from final acceptance of the work (but not earlier than 90 days after last work or material provided). \"Acceptance\" means completion of entire public project.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(116, 22, 1, 'Mechanics\' Lien (Projects in which the 1st mortgage or notice of contract is recorded on or after February 9, 1997)', 'Prime Contractor Mass. General Laws c. 254, Sec. 2.', 'Not Required', 'Contractor\'s Notice of Contract: Record Notice of written Contract in statutory form in Registry of Deeds not later than the earliest of (i) 60 days after recording Notice of substantial completion (ii) 90 days after recording Notice of Termination, or (iii) 90 days after last furnishing labor or materials by the General Contractor or anyone working by, through or under him.', 'Record Statement of Account in Registry of Deeds not later than the earliest of (i) 90 days after recording Notice of substantial completion (ii) 120 days after recording Notice of Termination, or (iii) 120 days after last furnishing labor or materials by the General Contractor or anyone working by, through or under him.', 'File suit within 90 days after filing of Statement of Account. Record attested copy of complaint in Registry of Deeds within 30 days of filing.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(117, 22, 1, 'Mechanics\' Lien (Projects in which the 1st mortgage or notice of contract is recorded on or after February 9, 1997)', 'Subcontractor\'s Notice of Contract: Record Notice of written Contract in statutory form in Registry of Deeds not later than the earliest of (i) 60 days after recording Notice of substantial completion (ii) 90 days after recording Notice of Termination, or (iii) 90 days after last furnishing labor or materials by the General Contractor or anyone working by, through or under him and serve owner with a copy of notice of contract.', 'Record Statement of Account in Registry of Deeds not later than the earliest of (i) 90 days after recording Notice of substantial completion (ii) 120 days after recording Notice of Termination, or (iii) 120 days after last furnishing labor or materials by the General Contractor or anyone working by, through or under him.', 'File suit within 90 days after filing of Statement of Account. Record attested copy of complaint in Registry of Deeds within 30 days of filing.', 'Record Statement of Account in Registry of Deeds not later than the earlist of(i) 90 days after recording Notice of substantial completion (ii) 120 days after recording Notice of Termination, or (iii) 120 days after last furnishing labor or materials by the General Contractor or anyone working by, through or under him.', 'File suit within 90 days after filing of Statement of Account. Record attested copy of complaint in Registry of Deeds within 30 days of filing.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(118, 22, 1, 'Mechanics\' Lien (Projects in which the 1st mortgage or notice of contract is recorded on or after February 9, 1997)', 'Subcontractor or Supplier (with no direct contractual relationship with the prime contractor.) Mass. General Laws c. 254, Sec. 4.', 'Give written notice of identification to prime contractor by certified mail in statutory form within 30 days of commencement of performance.', 'Record Notice of written Contract in statutory form in Registry of Deeds not later than the earliest of (i) 60 days after recording Notice of substantial completion (ii) 90 days after recording Notice of Termination, or (iii) 90 days after last furnishing labor or materials by the General Contractor or anyone working by, throught or under him. and serve owner with a copy of notice of contract.', 'Record Statement of Account in Registry of Deeds not later than the earliest of (i) 90 days after recording Notice of substantial completion (ii) 120 days after recording Notice of Termination, or (iii) 120 days after last furnishing labor or materials by the General Contractor or anyone working by, throught or under him.', 'File suit within 90 days after filing of Statement of Account. Record attested copy of complaint in Registry of Deeds within 30 days of filing.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(119, 22, 2, 'Suit against Prime Contractor\'s Payment Bond Surety', 'Not Required', 'Notice Of Claim on Bond: Certified mail notice (return receipt requested) to general contractor within 65 days of last furnishing labor and/or material stating 1. amount claimed and 2 . Name of party with whom contracted ?§29', 'Not Available', 'File Suit Within 1 year from last date furnished labor and/or material required by the subcontract.', 'File suit within 1 year from date last furnished labor and/or material required by subcontract.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(120, 22, 2, 'Subcontractor or Materialman (with no direct contractual relation with Prime Contractor and furnishing specially fabricated material)', 'Written notice to prime Contractor of the placement and amount of the order within 20 days after receiving final written approval for use of materials', 'Notice of Claim on Bond: Certified mail notice (return receipt requested) to general contractor within 65 days of last furnishing labor and/or material stating 1. amount claimed and 2. Name of party with whom contracted. §29', 'Not Available', 'File suit within 1 year from last date furnished labor and/or material required by the subcontract.', 'File suit within 1 year from date last furnished labor and/or material required by subcontract.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(121, 23, 1, 'Construction Lien - Commercial Construction (Residential work has other rules)', 'Contractor', 'Not Required', 'Sworn Statement: Before payment draws subcontractor to give contractor sworn statement - LIEN IS UNENFORCEABLE until sworn statement is provided. Give sworn statement to contractor within 30 days after wages are due as to laborer, otherwise lien is invalid. Provide copy of Notice of Commencement or name and address of owner or lessee within 10 days of written request by subcontractor, supplier, or laborer who has direct contract with contractor. M.C.L.A. §570.1110', 'Claim of Lien: Record within 90 days of last performance. Serve copy on owner\'s designee within 15 days, certified mail, after recording.', 'File suit within 1 year of lien filing & file Lis Pendens Notice.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(122, 23, 1, 'Construction Lien - Commercial Construction (Residential work has other rules)', 'Subcontractor, Materialman, Laborer (a supplier to a supplier does not have lien rights).', 'Notice of Furnishing: Within 20 days of first delivery or furnishing. However, Notice of furnishing must be filed within 10 days of receipt of Notice of Commencement, when Notice of Commencement is sent upon request that is submitted within 20 days of first delivery or furnishing. M.C.L.A. §570.1109 Serve Notice of Furnishing by certified mail to owner\'s designee and general contractor and other parties in contract privity with lienor, otherwise lien is prejudiced to the extent of payments (made prior to notice) by owner to contractor for lien claimant\'s work.', 'Sworn Statement: Before payment draws, subcontractor to give contractor sworn statement - LIEN IS UNENFORCEABLE until sworn statement provided. Give sworn statement to contractor within 30 days after wages are due as to laborer, otherwise lien is invalid. M.C.L.A. §570.1110', 'Claim of Lien: Record within 90 days of last performance. (Attach proof of service for the \"notice of furnishing sent to owner). Serve copy on owner\'s designee within 15 days, certified mail, after recording.', 'File suit within 1 year of lien filing & file Lis Pendens Notice.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(123, 23, 2, 'Payment Bond - Non- Highway - Public Municipal Projects', 'Subcontractor, Materialman, Laborer (not in privity with General Contractor)', 'Initial Notice of Claim on Bond (Public Project): If no direct contractual relationship with principal contractor, then within 30 days after first furnishing materials or labor, give written notice, by certified mail, to principal contractor of material to be furnished or labor to be performed, identify party contracting for such labor, materials, and identify project site.', 'Second Notice of Claim on Bond (Public Project): If no direct contractual relationship with principal contractor, then within 90 days of last performance, written notice by certified mail to principal contractor & Governmental unit of amount claimed (with substantial accuracy) & identity party to or for whom labor or material was performed or supplied.', 'Not Available', 'File suit after 90 days of lienor\'s last work, but within 1 year after final payment was made to principal contractor.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(124, 23, 2, 'Suite on Payment Bond for Highway Work (Michigan Dept. of Transportation)', 'Subcontractor, Materialman, Laborer', 'None Required', 'Within 60 days of last performance, send notice in duplicate by certified mail to principal contractor and officer or agent contracting on behalf of state, county, city, etc.', 'Not Available', 'File suit within 1 year of completion & acceptance of project.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(125, 24, 1, 'Mechanics\' Lien', 'Contractor', 'Contractor\'s Pre-Lien Notice: Notice and copy of contract to owner M.S.A §514.011(a) No Contract: Notice to Owner within 10 days \"after work of improvement is agreed upon.\" M.S.A. §514.011(1)', 'Give notice within 120 days of last performance.', 'Statement of Mechanic\'s Lien Claim: Record lien within 120 days of last performance.', 'File suit within 1 year of last performance.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(126, 25, 1, 'Stop Notice', 'Subcontractor, Material Supplier of Prime Contractor dealing directly with General Contractor (Only people with privity of contract with the General Contractor have Stop Notice rights.)', 'Not Required', 'Stop Notice: If contractor does not pay subcontractor, or supplier, subcontractor or supplier may give written Notice of Claim to owner, who must then hold funds or suffer possibility of suit to declare lien on realty.', 'No filing required, but Stop Notice applies only as long as owner is actually holding funds owed to prime contractor.', 'File Suit within 1 year from last furnishing labor or materials.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(127, 25, 2, 'Suit on Payment Bond - No minimum amount', 'Sub-subcontractor & Materialman of 1st Tier Subcontractors', 'Not Required', 'Notice of Claim on Bond (Public Project): Give notice within 90 days after last performance of supply of material if claimant does not have direct contract with prime contractor.', 'Not Available', 'File suit within 1 year from written acceptance by owner or actual occupancy, whichever occurs first.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14');
INSERT INTO `lien_bound_summaries` (`id`, `state_id`, `project_type_id`, `rights_available`, `claimant`, `prelim_notice`, `other_notice`, `lien`, `suit`, `notes`, `created_at`, `updated_at`) VALUES
(128, 26, 1, 'Mechanics\' Lien: liens can arise from contracts made by lessees and their agents.', 'Contractor', 'Contractor\'s Notice of Claim: Written notice to owner of potential claims of subs to be included in written contract, or mailed, prior to receiving payment or with first invoice when the work is commenced. M.R.S. §429.012', 'Not Required', 'Lien Statement: Record lien at least 10 days after filing notice, but within 6 months from last performance. M.R.S. §429.080', 'File suit within 6 months after lien is filed.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(129, 26, 1, 'Mechanics\' Lien: liens can arise from contracts made by lessees and their agents.', 'Subcontractor, Materialman', 'For owner occupied residential property of 4 families or less, consent to lien by owner must be part of contract for lien rights to exist in favor of subcontractor/material-man.', 'Subcontractor\'s Notice of Lien: Notice of Claim to owner 10 days before filing lien (presonal service required). M.R.S. §429.100', 'Lien Statement: Record lien within 6 months after last performance. M.R.S. §429.080', 'File suit within 6 months after lien is filed.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(130, 27, 1, 'Mechanics\' Lien', 'Contractor, Subcontractor, Materialman', 'Notice of Right to Claim a Lien: Required. It must be filed with County Clerk & served on owner within 20 days of first performance if work relates to noncommercial residential dwelling for 4 or fewer families. If notice is not given within this period, a lien is enforceable only for the services or materials furnished within the 20 day period before the date on which notice is given. Persons who furnish directly to owners are not required to file notice. Wage earners or laborers who perform personal labor services are NOT required to file notice. If payment made from funds provided by a regulated & secured lender, then Preliminary Notice must be filed within 45 days of first performance.', 'Contracting owner may file a Notice of Completion at any time after the completion of any work or improvement. The contracting owner shall give a copy of the Notice of Completion to any person who has given the contracting owner a Notice of Right to Claim a Lien.', 'Construction Lien: Record lien & serve contracting owner within 90 days after a last performance or the contracting owner\'s Notice of Completion pursuant to §71-3-535. §71-3-536.', 'File suit within 2 years after date lien filed.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(131, 27, 2, 'Suit on Payment Bond - bond minimum 100% (state) or 25% (local)', 'Subcontractor, Materialman, Sub-subcontractor', 'Suppliers, providers & materialmen performing work on public projects must supply written notice delivered personally or by certified mail to the prime contractor not later than 30 days after first delivery of materials or supplies to subcontractor. Notice must state the right of action on the bond, that delivery of materials & supplies have commenced, the name of the sub who placed the order, to whom the materials & supplies were shipped and that the prime contractor & his bond will be held responsible for the amount unpaid by the subcontractor.', 'Notice of Claim on Bond (Public Project): Written Notice of Claim to Public Authority within 90 days after completion & formal acceptance of the project. §18-2-204', 'Not Available', 'No statutory provision. Must obtain copy of bond since individual Surety may waive time limits.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(132, 28, 1, 'Construction Lien', 'Anyone except \"suppliers to suppliers\" with Real Estate Improvement Contract for services, labor or to furnish materials (includes contractors, subcontractors, materialmen, architects, etc.)', 'May be given', 'May be given', 'Lien Claim: Record lien not later than 120 days after final furnishing of services or materials. Notice of Lien must be given to preserve certain rights against protected owner. § 52-137', 'Lien enforceable for 2 years after recording judicial proceedings to enforce within 2 years extends effect of lien until termination of proceedings.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(133, 28, 2, 'Suit on 100% Payment Bond', 'Subcontractor/ *Supplier (no direct contract with General Contractor) *Supplier to Supplier = no Bond Claim rights', 'Not Required', 'Notice of Claim on Bond to General Contractor by certified mail or registered mail within 4 months from last performance. §52-118.01', 'Not Available', 'Suit to enforce claim: Not earlier than 90 days from claimants final date of furnishing, but within 1 year of final settlement of principal contract. §§ 52-118.01 & 52- 118.02', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(134, 29, 1, 'Mechanics\' Lien', 'Contractor', 'Contractor\'s Notice to Owner: Written notice of potential Preline Notices by subs must be given to owner and subcontractors prior to signing prime contract. §108.221, §108.245, §108.246', 'Not Required', 'Notice of Lien: Record Lien within 90 days after last performance or completion of project, whichever is latest. If a Notice of Completion is timely recorded, record lien within 40 days after the Owner records a Notice of Completion. NRS §108.226. Must serve Notice on record property owner within 30 days of recording (special service requirements). NRS §108.227. Notice to General Contractor. NRS §108.246', 'File suit not less then 30 days nor more than 6 month after Lien recorded. NRS §108.244 and §108.233', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(135, 29, 1, 'Mechanics\' Lien', 'Subcontractor, Materialman (Persons not in privity with Owner, and Laborer ONLY)', 'Notice of Owner of Materials Supplied, Work or Services performed: Written notice of possible claim to Owner & General Contractor within 31 days after first performance, by personal service or certified mail, return receipt requested copy of notice to (record) owner, reputed owner or person whose name appears as owner on Building Permit. NRS §108.245', 'Not Required', 'Notice of Lien: Record Lien within 90 days after last performance or completion of project, whichever is latest. If a Notice of Completion is timely filed, record Lien within 40 days after the Owner files a Notice of Completion.NRS §108.226. Must serve Notice on record property owner within 30 days of recording (special service requirements) NRS§108.227. Notice to General Contractor. NRS §108.246', 'File suit not less than 30 days nor more then 6 month after Lien recorded. NRS §108.244. and §108.233', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(136, 29, 2, 'Suit on Payment Bond - Contracts Exceeding $35,000 bond minimum 50%', 'Subcontractor, Materialman (Direct privity with General Contractor)', 'Not Required', 'Not Required', 'Not Available', 'File suit not less then 90 days nor more then 1 year after claiment\'s last performance. NRS §339.035, §339.055', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(137, 29, 2, 'Suit on Payment Bond - Contracts Exceeding $35,000 bond minimum 50%', 'Sub-Subcontractor, Materialman to Subcontractor', '30-day Notice of Claim on Public Project): To contractor within 30 days of first performance. NRS §339.035(2)(a)', '90-day Notice of Claim on Bond (Public Project): To contractor within 90 days after last performance. NRS § 339.035(2)(b)', 'Not Available', 'File suit not less than 90 days nor more than 1 year after claimants\'s last performance. NRS §339.035, §339.055', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(138, 29, 2, 'Suite on Highway Contracts: Payment Bond 100%', 'Subcontractor, Materialman, and lower tier parties', 'Notice of Claim on Bond (Public Project): Within 30 days of Notice of Final Acceptance of the Contract §408.387. Statutory Form. NRS §408.363', 'Not Required', 'Not Available', 'File Suit against Bond within six month of filing Notice of Bond Claim. NRS §408.363', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(139, 30, 1, 'Mechanics\' Lien', 'Contractor', 'Not Required', 'Not Required', 'Record lien within 120 days after last performance. Note that lien is perfected by recording of attachment issued by Court.', 'Lien must be perfected by attachment of property within 120 days after last performance.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(140, 30, 1, 'Mechanics\' Lien', 'Subcontractor, Materialman; (Lower tiered claimants\' liens limited to amounts due to their immediate contractor - THIS PARTY IS IN PRIVITY W/G.C. OR SUB.)', 'Subcontractor\'s Notice of Lien: To owner of Intent to claim lien before delivery. §447:5', 'Statement of Account: To owner every 30 days, otherwise, only entitled to money owed to general contractor from owner. Notice to Provider of Construction Funds: If name of lender is posted: Notice of Furnishing within 15 days after posting. §447:12-b', 'Record lien within 120 days of last performance. Note that lien is perfected by recording of attachment issued by Court.', 'Lien must be perfected by attachment of property within 120 days after last performance.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(141, 30, 2, 'Lien on Unpaid Retention', 'Subcontractor, Materialman', 'None Required', 'Statement of Claim on Bond (Public Work): To Proper Government Body of Claim within 90 days of completion and acceptance of project.', 'Not Available', 'File petition in court to enforce lien within 1 year of Notice of Claim.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(142, 30, 2, 'Suit on Payment Bond - 100%', 'Subcontractor, Materialman', 'None Required', 'Statement of Claim on Bond(Public Work): To Proper Government Body of Claim within 90 days of completion and acceptance of project.', 'Not Available', 'File petition in court to enforce claim on bond within 1 year of Notice of Claim.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(143, 31, 1, 'Construction Lien', 'Contractor', 'Not Required', 'Notice of Unpaid Balance & Right to File Lien: May be filed any time during the 90 day Construction Lien Claim period to preserve priority over subsequent mortgages, purchasers & encumbrances. Residential construction: Must file Notice of Unpaid Balance and Right to File Lien and Demand for Arbitration (Arbitration must be competed within the 90 lien period)', 'Construction Lien Claim: File no later than 90 days following date of last work, services, material or equipment provided. Service of lien claim must be by personal service, or registered/certified mail, return receipt requested, to owner against whom claim is asserted, within 10 business days after filing.', 'File suit within one year from date of last work, services, material, equipment or payment to which lien claim is filed or within 30 days after notice from owner to commence action to establish lien claim. Notice of Lis Pendens must be filed when suit commenced.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(144, 31, 1, 'Construction Lien', 'Subcontractor or Materialman (Must have written contract with original contractor, or subcontractor in direct privity of contract with original contractor.)', 'Not Required', 'Notice of Unpaid Balance & Right to File Lien: May be filed any time during the 90 day Construction Lien Claim period to preserve priority over subsequent mortgages, purchasers & encumbrances. Residential Construction: Must  file Notice of Unpaid Balance and Right to File Lien and Demand for Arbitration (Arbitration must be competed within the 90 lien period)', 'Construction Lien Claim: File no later than 90 days following date of last work, services, material or equipment provided. Service of lien claim must be by personal service, or registered/certified mail, return receipt requested, to owner, contractor & subcontractor against whom claim is asserted, within 10 business days after filing.', 'File suit within one year from date of last work, services, material, equipment or payment to which lien claim is filed or within 30 days after notice from owner to commence action to establish lien claim. Notice of Lis Pendens must be filed when suit commenced.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(145, 31, 1, 'Mechanics\' Lien', 'Design Professionals, Construction Managers, Consultants (Must have a mutually signed contract)', 'Not Required', 'Notice of Unpaid Balance & Right to File Lien: May be filed any time during the 90 day Construction Lien Claim period to preserve priority over subsequent mortgages, purchasers & encumbrances. Residential construction: Must file Notice of Unpaid Balance and Right to File Lien and Demand for Arbitration. (Arbitration must be competed within the 90 lien period)', 'Construction Lien Claim: File no later than 90 days following date of last work, services, material or equipment provided. Service of lien claim must be by personal service, or registered/certified mail, return receipt requested, to owner, contractor & subcontractor against whom claim is asserted, within 10 business days after filing.', 'File suit within one year from date of last work, services, material, equipment or payment to which lien claim is filed or within 30 days after notice from owner to commence action to establish lien claim. Notice of Lis Pendens must be filed when suit commenced.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(146, 32, 1, 'Mechanics\' Lien', 'Contractor', 'Not Required', 'Not Required', 'Lien Claim: Record within 120 days, after completion of contract.', 'File suit within 2 years after date lien filed.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(147, 32, 2, 'Little Miller Act - Payment Bond', 'Subcontractor, Materialman', 'Not Required', 'Notice of Claim on Bond (Public Project): Written Notice of Claim to contractor by registered letter within 90 days after last performance.', 'Not Required', 'File suit within 1 year after final settlement of prime contract.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(148, 31, 2, 'Suit on Payment Bond - Bond minimum 100% contract price', 'Subcontractor, Materialman (Notice is required if privity of contract does not exist with General Contractor; notice is not required if privity of contract with the General Contractor does exist.)', 'Any person who does not have a direct contract with the contractor who furnishes the bond is obligated to provide written notice to the contractor, by certified mail, that he is a beneficiary of the bond prior to commencing any work. Failure to provide notice limits the bond claimant to benefits available from the date notice is provided. NJSA 2A 44-145', 'Notice of Claim to surety within 1 year from the last date upon which the materials or labor have been provided. NJSA 2A:44-145', 'Not Available', 'Suit cannot be instituted until 90 days after notice is given to surety, but no later than one year from the date upon which work or materials were last provided to the project. NJSA 2A:44-145', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(149, 31, 2, '\"\"Lien\" Against Unpaid Funds for municipal', 'county', 'and political subdivisions', 'not state-owned projects.\"', 'Subcontractor, Materialman', 'Written notice w/in 20 days of first performance to government entity in charge. If notice is not filed, lien rights are barred except to the extent that money is owed by General Contractor to the sub to whom the labor and materials were provided. If notice is filed after 20 day period, a lien may be filed for materials or labor provided after the filing, this notice.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(150, 32, 1, 'Mechanics\' Lien', 'Subcontractor, Materialman (those not in privity with contractor)', 'Notice of Right to Claim a Lien: If claim is more than $5,000, written notice within 60 days after first furnishing work or materials by certified mail or fax. If claim filed greater than 60 days after first furnishing it will protect only material shipped 30 days prior to date of Notice.', 'Not Required', 'Lien Claim: Record within 90 days, after completion of project.', 'File suit within 2 years after date lien filed.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(151, 34, 1, 'Mechanics\' Lien', 'Contractor', 'Notice of Contract: Filed and served within 30 days of issue of building permits.', 'Not Required', 'Claim of Lien: Record after obligation due, but within 120 days of last furnishing labor or materials to the project.', 'File suit within 180 days of last furnishing of labor or materials to the project.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(152, 34, 1, 'Mechanics\' Lien', 'Subcontractor, Materialman, Architect, Surveyor', 'Not Required', 'Notice of Subcontract: Filed only if NOT in privity with General Contractor and GC files Notice of Contract w/in 30 days of building permit being issued. Notice of Claim of Lien by any subcontractor should be filed as soon as possible.', 'Claim of Lien: Record after obligation due, but within 120 days of last furnishing  labor or materials to the project.', 'File suit within 180 days of last furnishing of labor or materials to the project.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(153, 34, 1, 'Mechanics\' Lien (Contract Funds)', 'Subcontractor, Materialman, Architect, Surveyor', 'Notice of Claim of Lien: to obligor -- owner, general contractor, and higher-tier subcontractors. §44A-19 ( c) .', 'Not Required', 'Not Available', 'Not Available', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(154, 34, 2, 'Suit on 100% minimum Payment Bonds for contracts over $300,000.00', 'Subcontractor or Materialman in privity with Contractor', 'Required', 'Required', 'Not Available', 'File suit after 90 days from last furnishing labor or materials and prior to 1 year from last furnishing labor or materials or from contractor\'s final settlement, whichever is longer.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(155, 34, 2, 'Suit on 100% minimum Payment Bonds for contracts over $300,000.00', 'Subcontractor or Materialman lacking privity with Contractor.', 'Required', 'Notice of Claim on Payment Bond: To contractor within 120 days of last furnishing of labor or materials for which payment is claimed, by registered or certified mail.', 'Not Available', 'File suit after 90 days from last furnishing labor or materials and prior to 1 year from last furnishing labor or materials or from contractor\'s final settlement, whichever is longer.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(156, 35, 1, 'Mechanics\' Lien', 'Contractor, Subcontractor, Materialman (in privity with Owner or any agent of Owner)', 'Not Required', 'Give Notice of Intent to perfect lien to owner after furnishing material or labor and prior to owner disbursing funds. NDCC Chapter 35-27-05', 'Mechanics\' Lien: Record lien within 90 days of last performance and give notice to owner.', 'File suit within 3 years of recording Notice of Intention to Claim a Lien and no less than 10 days (personal service) or 20 days (registered mail service) after a Notice of Intent to Enforce the Lien is served by or 30 days after a demand by owner, agent or contractor.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(157, 35, 1, 'Mechanics\' Lien', 'Materialman Note: Liens are impaired to extent of payments by owner prior to recording, so it behooves claimant to act promptly.', 'Not Required', '(Must make demand for payment on Owner at least 15 days prior to filing the lien as a condition precedent to obtaining a lien for materials).', 'Not Available', 'Not Available', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(158, 35, 2, 'Suit on Payment Bond - 100% of contract price', 'Materialman, Subcontractor', 'Not Required', 'Notice of Claim on Bond: Supplier of contractor must give registered mail (return receipt requested) Notice of Claim to principal contractor within 90 days of last performance. If the claimant is not in privity with principal on bond, there is no right to bond claim unless claimant complies with notice of requirements under NDCC 48-02-15.', 'Not Available', 'All suits must be filed within 1 year after completion & acceptance of the project.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(159, 37, 1, 'Mechanics\' Lien', 'Subcontractor, Materialman', 'Pre-Lien Notice: Prior to filing Lien statement but not later that 75 days after the first date of furnishing of labor, materials, or equipment once served it is good for rest of project and no longer needs to be served. 1 & 2', 'Not Required', 'Lien Statement: Record within 90 days of date of last performance or delivery. When recording Lien Recorder serves Notice to owner with in one day of Recording. Lien must have certificate to O.S. section 142.6 attached.', 'File suit within 1 year from date of filing lien, or lose right.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(160, 45, 2, 'Suit on Payment Bond - minimum 100% & suit against owner for failure to require such Bonds', 'Subcontractor, Materialman', 'Not Required', 'If no bond required by owner notice within 90 days of final furnishing.', 'Not Available', 'File suit not less than 90 days nor more than 1 year after last performance by subcontractor or materialman.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(161, 46, 1, 'Mechanics\' Lien', 'Contractor', 'Not Required', 'Not Required', 'Memorandum of Lien: Record within 120 days of date payment due for material or services. T. 9 §1923', 'File suit & attach property within 3 months of date of lien filing or date payment was due. Judgment may be filed within 5 months after obtaining judgment.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(162, 36, 1, 'Mechanics\' Lien', 'Contractor Definitions: (A home purchase contract is a contract for the purchase of a 1 or 2 family dwelling or residential condo unit for use as a personal residence. A home construction contract is a contract between an owner and the original contractor for the construction or improvement of a 1 or 2 family dwelling or condo unit used as the owner\'s personal residence.)', 'Notice of  Commencement: By Owner in the County Recorder\'s Office before construction commences, post a copy at the project site and serve a copy upon the contractor. Required for 1 or 2 family dwellings and residential condo units except for work performed under a home construction contract. No posting required for a home purchase contract. * Not required for gas and oil wells, pipelines and railroads.  * Optional for telephone, electric and gas companies, but subject to liabilities for failure to record. * All tiers from owner downward must furnish Notice of Commencement within 10 days of request from a lower tier.', 'Not Required', '1 or 2 family dwellings or residential condo units: File within 60 days of last work. Serve copy upon owner within 30 days of filing. Gas and oil wells, derricks and pipelines: File within 120 days of last work. Serve copy upon owner and purchaser or pipeline carrier within 30 days of filing. Railroads: File within 40 days of last work. Serve copy upon owner within 10 days of filing. Special affidavit required. \"Notice\" requirements not applicable. All other construction: File within 75 days of last work. Serve copy upon owner within 30 days of filing. Registered Land: For land registered pursuant to the Torrens System, serve owner within 10 days of filing lien affidavit, file proof of service within 30 days of service.', 'File suit within 60 days of the service of the notice to lienholder to commence suit, but no later than 6 years after the filing of the lien.', 'NULL', '2018-03-23 06:58:14', '2018-03-23 06:58:14'),
(163, 36, 1, 'Mechanics\' Lien', 'Subcontractor, Materialman, Laborer Prompt Pay Provisions Effective for all contracts entered into after 4/10/91. Not applicable to 1, 2, 3 family detached dwellings or residential condo units. Contractor shall pay subcontractors, materialmen and laborers within 10 days after receipt of payment from owner. 18% per annum interest accrues after the 10th day. Reasonable attorney\'s fees and costs accrue after 30 days. Subcontractors and materialmen have same obligation to lower tier subcontractors, materialmen and  laborers. Ohio Rev. Code §4113.61.', 'Obtain a copy of the \"Notice of Commencement\" from the owner, contractor or upper tier subcontractor or materialman. There are penalties for failure to furnish \"Notice of Commencement\" after a request.', 'Notice of Furnishing: To owner and contractor within 21 days of work or furnishing of materials. No lien rights for work performed or materials furnished prior to 21 days of serving \"Notice of Furnishing.\" Not required for laborers, home construction contract\'s, gas & oil wells, pipelines & railroads.', '1 or 2 family dwellings or residential condo units: File within 60 days of last work. Serve copy upon owner within 30 days of filing. Gas and oil wells, derricks and pipelines: File within 120 days of last work. Serve copy upon owner and purchaser or pipeline carrier within 30 days of filing. Railroads: File within 40 days of last work. Serve copy upon owner within 10 days of filing. Special affidavit required. \"Notice\" requirements not applicable. All other construction: File within 75 days of last work. Serve copy upon owner within 30 days of filing. Registered Land: For land registered pursuant to the Torrens System, serve owner within 10 days of filing lien affidavit, file proof of service within 30 days of service.', 'File suit within 60 days of the service of the notice to lienholder to commence suit, but no later than 6 years after the filing of the lien.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(164, 36, 2, 'Lien on Public Funds', 'Subcontractor, Materialman, Laborer Prompt Pay Provisions Effective for all contracts entered into after April 10, 1991. Contractor shall pay subcontractors, materialmen and laborers within 10 days after receipt of payment from Public Authority. 18% per annum interest accrues after the 10th day. Reasonable attorney\'s fees and costs accrue after 30 days. Subcontractors and materialmen have the same obligation to lower tier subcontractors, materialmen and laborers. Ohio Rev. Code §4113.61', 'Public Authority shall make \"Notice of Commencement\" available. Contractors and subcontractors shall provide, in writing, the name of the Public Authority and name of the contractor to lower tier subcontractors and materialmen. Not applicable to laborers.', 'Subcontractors and materialmen not having direct privity of contract with contractor must serve \"Notice of Furnishing\" upon contractor within 21 days of commencement of work performed or material furnished. §1311.261 No lien rights for work performed or material furnished prior to 21 days of serving \"Notice of Furnishing.\"', 'Serve Public Authority within 120 days of last labor, work or furnishing or material with the following: 1. Original Public Funds Lien Affidavit. 2. Copy of Notice of Furnishing. 3. Serve affidavit stating the date \"Notice of Furnishing\" was served on contractor. Record copy of lien affidavit with county recorder within 30 days after filing affidavit with public authority. If 2nd-Tier or lower tier party, serve copy of lien affidavit and \"Notice of Furnishing\" on contractor & all higher tier subcontractors and materialmen within 20 days after filing.', 'Public authority contractor, or subcontractor receiving copy of lien affidavit may demand that the lien holder commence suit. Suit must be filed within 60 days of service of the notice to commence suit.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(165, 36, 2, 'Payment Bonds on Public Projects*', 'Subcontractor, Materialman, Laborer', 'If not in privity with owner and contract amount over $30,000.00 must serve \"Notice of Furnishing\" upon contractor within 21 days of commencement of work performed or material furnished. §153.56 & §1131.261', 'Not Required', 'Notice upon surety within 90 days after project completion and acceptance of project by Public Authority.', 'Not earlier than 60 days after notice to Surety, but not later than 1 year after acceptance of the project by the Public Authority.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(166, 37, 1, 'Mechanics\' Lien', 'Contractor', 'Not Required', 'Notice to Owner: Written notice - by certified mail, return receipt requested - posting personal service.', 'Lien Statement: Record within 4 months of date of last performance.', 'File suit within 1 year from date of filing lien.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(167, 37, 1, 'Mechanics\' Lien', 'Equipment Leasor', 'Notice to Owner within five days of equipment being placed on-site.', 'Not Required', 'Lien Statement Record within 90 days of date of last performance or delivery. When recording Lien Recorder serves Notice to owner with in one day of Recording.', 'File suit within 1 year from date of filing lien, or lose right.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(168, 37, 1, 'Oil & Gas Lien', 'Contractor, Subcontractor, Materialman\'s Special List', 'Not Required', 'Notice to Owner: Within 180 days after date of last furnishing (by certified mail, return receipt requested - posting personal service).', 'Notice to Owner: Within 180 days after date of last furnishing (by certified mail, return receipt requested - posting personal service).', '', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(169, 38, 1, 'Mechanics\' Lien', 'Trustee of Employee Plans', 'Not Required', 'Not Required', 'Claim of Lien: For architects, landscape architects, engineers & trustees of employee benefit plans, 75 days after completion of construction of improvement.', 'Not Available', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(170, 39, 2, 'Suit on Payment Bond', 'Subcontractor', 'Not Required', 'Not Required', 'Not Available', 'File suit not less than 90 days nor more than 1 year plus 90 days after last performance.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(171, 37, 2, 'For Contracts over $25,000 [61 § 1] - Bond Required Retainage now provided for 10% until 50% of work being completed on project, 5% after 50% is completed.', 'Subcontractor, Materialman, Third Tier Subcontractor', 'Not Required', 'Notice of Claim on Bond: To Contractor & Surety within 90 days after last performance (by certified mail, return receipt requested).', 'File suit within 1 year after last performance.', '', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(172, 38, 1, 'Mechanics\' Lien', 'General Contractor', 'General Contractor to send Construction Contractor\'s Notice to owner on residential construction greater than $1,000 at time of execution or within 5 days of contract if oral. ORS Sec. 87.093', 'List of materials or description of labor with statement of charges and unpaid balance: within 15 business days of written demand from owner or mortgagee. ORS Sec. 87.027', 'Claim of Lien: Record not later than 75 days after cessation of labor or furnishing of materials or equipment or 75 days after completion of construction, whichever is earlier. Notice of Filing of Claim of Lien & copy of lien must be delivered to owner and mortgagee by mail (certified or registered return receipt) or hand delivery within 20 days after filing of lien in order to protect claim for attorney\'s fees, costs, and disbursements. ORS Sec.87.035 & 87.039.', 'File suit within 120 days after recording lien. Notice of Intent to Foreclose Lien must be delivered by hand delivery or mail (certified return receipt) in writing to owner and mortgagee not later than 10 days prior to filing suit in order to protect claim for attorney\'s fees. ORS Sec. 87.055 & 87.057.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(173, 38, 1, 'Mechanics\' Lien', 'Subcontractor', 'Notice of Right to Lien: (Residential projects only) within 8 business days of furnishing labor, services, or materials (not required if contracting directly with the owner or if a commercial project). ORS Sec. 87.021', 'List of materials or description of labor with statement of charges and unpaid balance: Within 15 business days of written demand from owner or mortgagee. ORS Sec. 87.027', 'Claim of Lien: Record not later than 75 days after cessation of labor or furnishing of materials or equipment or 75 days after completion of construction, whichever is earlier. Notice of Filing of Claim of Lien & copy of lien must be delivered to owner and mortgagee by mail (certified or registered return receipt) or hand delivery within 20 days after filing of lien in order to protect claim for attorney\'s fees, costs and disbursements. ORS Sec.87.035 & 87.039.', 'File suit within 120 days after recording lien. Notice of Intent to Foreclose Lien must be delivered by hand delivery or mail  (certified return receipt) in writing to owner and mortgagee not later than 10 days prior to filing suit in order to protect claim for attorney\'s fees. ORS Sec. 87.055 & 87.057.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(174, 38, 1, 'Mechanics\' Lien', 'Materialman, Equipment Lessors', 'Notice of Right to Lien: (residential projects only) within 8 business days of furnishing labor, services, or materials (not required if contracting directly with the owner or on commercial projects). ORS Sec. 87.021', 'List of materials or description of labor with statement of charges and unpaid balance: within 15 business days of written demand from owner or mortgagee. ORS Sec. 87.027', 'Claim of Lien: Record not later than 75 days after cessation of labor or furnishing of materials or equipment or 75 days after completion of construction, whichever is earlier. Notice of Filing of Claim of Lien & copy of lien must be delivered to owner and mortgagee by mail (certified return receipt) or hand delivery within 20 days after filing of lien in order to protect claim for attorney\'s fees, costs & disbursements. ORS Sec.87.035 & 87.039.', 'File suit within 120 days after recording lien. Notice of Intent to Foreclose Lien must be delivered by hand delivery or mail (certified or registered return receipt) in writing to owner and mortgagee not later than 10 days prior to filing suit in order to protect claim for attorney\'s fees, costs and disbursements. ORS Sec. 87.055 & 87.057.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(175, 38, 1, 'Mechanics\' Lien', 'Architect, Landscape Architect & Engineer', 'Notice of Right to Lien: (residential projects only) Within 8 business days of furnishing labor, services, or  materials (not required if contracting directly with the owner or on commercial projects). ORS Sec. 87.021', 'Notice of Filing of Claim of Lien & copy of lien must be delivered to owner and mortgagee by mail (certified or registered return receipt) or hand delivery within 20 days after filing of lien. Place list of Materials here if services not requested by owner & other exceptions do not apply. §87.035 & 87.039', 'Claim of Lien: For architects, landscape archetects, engineers & trustees of employee benefit plans, 75 days after completion of construction of improvement.', 'File suit within 120 days after lien is filed. Notice of Intent to Foreclose Lien must be delivered by hand delivery or mail (certified or registered return receipt) in writing to owner and mortgagee not later than 10 days prior to filing suit in order to protect claim for attorney\'s fees, costs and disbursements. ORS Sec. 87.055 & 87.057.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(176, 38, 2, 'Suit on Contractor\'s Bond', 'Subcontractor, Third Tier Subcontractor, Materialman w/ contract w/ general contractor or sub w/ direct contract w/ general contractor & any persons claiming monies due the State Accident Insurance Fund Corporation, State Department of Employment Trust Fund or Department of Revenue', 'Not Required', 'Notice of Claim on Bond: Written Notice of Claim to state agency & contractor by registered or certified mail or hand delivered no later than 120 days after last providing labor or materials or 120 days after the worker listed in the notice of claim by the commissioner of the bureau of Labor and Industries last provided labor or, if the claim is for a required contribution to a fund of any employee benefit plan, within 150 days after the employee last provided labor or materials.', 'Not Available', 'File suit no later than expiration of 2 years after last providing labor or materials or 2 years after the worker listed in the commissioner\'s notice of claim last provided labor.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(177, 39, 1, 'Mechanics\' Lien', 'Contractor Subcontractor (Warning: The lien is not available to a \"supplier\" for the subcontractor.) WARNING: Pennsylvania has a unique provision which allows the general contractor to waive all mechanics\' lien rights for subcontractors by properly filing and indexing a waiver agreement with the county where the project is located. As such, a mechanics\' lien remedy is often not available since most owners require the general contractor to sign the waiver. However, there are potential legal defenses which may render the waiver ineffective under certain factual circumstances.', 'Not Required', 'Notice of Intention to file a Claim: To owner on or before date of completion of subcontractors work when contract is for alteration or repair.Formal Notice to Owner: All subcontractors must give written notice to owner of intent to file a lien 30 days before filing lien. (By certified mail, personal service by sheriff, or if service cannot be made, by posting for the above).', 'Claim of Lien: Record within 4 months after lienor\'s date of completion, and serve Owner within 1 month after filing. (By personal service by sheriff or, if service cannot be so made, by posting.) Affidavit of Service of \"Notice of Filing of Claim\": File within 20 days of service of claim.', 'File suit within 2 years after date lien filed.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(178, 39, 2, 'Suit on Payment Bond', 'Second Tier Sub (one who supplies labor or materials to a subcontractor, a supplier to a supplier is not covered).', 'Not Required', 'Notice of Claim on Bond: To contractor within 90 days of claimant\'s last performance of labor or delivery of material. (By certified mail, return receipt requested.) Copies to owner & Surety recommended, but not required.', 'Not Available', 'File suit not less than 90 days nor more than 1 year plus 90 days after last performance.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(179, 40, 1, 'Mechanics\' Lien', 'Contractor, Subcontractor, Equipment Lessor, Engineer, Architect, Laborer, Supplier', 'Notice of Intention: To owner, before or within 120 days of first labor or furnishing of material by certified mail, return receipt requested. §34-28-4 (if notice returned undelivered special  procedure).', 'Copy of Notice of Intent: Record with office of land evidence of town that property is located within 120 days of last performance. - Architect or Engineer: May give notice within 10 days after actual & visible commencement by excavator. Notice of Lis Pendens: File in the records of land evidence in the city or town in which such land is located within one hundred twenty (120) days of the date of the recording of the Notice of Intention provided in §34-28-4 and § 34-28-7.', 'Petition: To the superior court for the county in which is situated the land upon which the building, canal, turnpike, railroad, or other improvement is being or has been constructed, erected, altered, or repaired, on the same day as the Notice of Lis Pendens, or within seven (7) days thereafter, and within one hundred twenty (120) days of the date of the recording of the Notice of Intention provided in § 34-28-4 and § 34-28-7. This lien petition Is the suit to enforce the ML. They are not separate filings.', 'Suit filed before 120 days after filing Notice of Intent (special procedure architect or engineer) Notice of Lis Pendens also to be filed. §34-28-10', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(180, 40, 1, 'Right to Payment of Mortgage Funds (for loans under $500,000.00 only)', 'Subcontractor, Materialman', 'None Required', 'By registered mail serve notice to mortgagee of recorded lien or recorded notice of intent to lien requires mortgagee to hold funds or distribute funds to mortgagee and claimant jointly.', 'Not Available', 'If contractor objects to payment, bank must hold amount due to subcontractor or materialman until dispute is resolved.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(181, 40, 2, 'Suit on Payment Bond - minimum 50% of contract price of over $5,000.00', 'Subcontractor, Third tier Subcontractor, Supplier of Material & Equipment', 'Not Rquired', 'Notice of Claim on Bond (Public Project): The 90 day statutory notice has been effectively abrogated by § 34-28-30 and cases which have been decided thereunder.', 'Not Available', 'All suits filed within 2 years after date of last day of work or as set by bond if longer.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(182, 41, 1, 'Mechanics\' Lien', 'Contractor, Subcontractor', 'Not Available', 'Not Available', 'Record lien within 90 days of last performance or furnishing of materials; copy to owner (personal service).', 'File suit within six months of last performance or furnishing of materials.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(183, 41, 1, 'Mechanics\' Lien', 'Sub-Subcontractor, Materialman, Architect, Engineer, Grading & Paving Contractor, Utility Contractor Private Security Services', 'Preliminary Notice to Owner: To preserve full price lien for filers without privity with General  Contractor. If no Preliminary Notice, lien claim limited to unpaid contract funds.', 'Statement of Account: To Owner within 90 days after last date of performance or furnishing materials, by certified mail, return receipt requested of amount owed unless owner gives Notice of Refusal of Responsibility for liens. Service of lien suffices as notice. § 29-5-90', 'Record lien within 90 days of last performance or furnishing of materials; copy to owner (personal service).', 'File suit within six months of last performance or furnishing of materials.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(184, 41, 1, 'Payment Bond', 'Subcontractor, Materialman, Architect, Engineer, Grading & Paving Contractor, Utility Contractor Private Security Services', 'None Required', 'Often bond requires notice to be given within 90 days after last performance.', 'Not Available', 'Any limitation period provided in bond is void. Statutory limitation is three (3) years.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(185, 41, 2, 'Suit on Highway Contracts: minimum 50% Payment Bond on over $10,000.00', 'Suit on Highway Contracts: minimum 50% Payment Bond on over $10,000.00', 'None Required', 'Notice of Claim: Served personally upon Contractor or by certified mail within 90 days of last performance or furnishing of materials. Notice must include date furnished, name of person to whom furnished & amount.', 'Not Available', 'All suits filed within 1 year of final settlement of contract, but not before expiration of 90 days after last performance.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(186, 41, 2, 'All Public Projects (State, Municipal, Special Purpose Districts, etc.), 100% Payment Bond', 'Subcontractor, Equipment Leasor Material Supplier', 'Not Required', 'Not Required', 'Not Available', 'All suits filed within 1 year of last performance or furnishing of materials.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(187, 41, 2, 'All Public Projects (State, Municipal, Special Purpose Districts, etc.), 100% Payment Bond', 'Sub-Subcontractor and Material Supplier or Equipment Leasor to a Subcontractor (Lower tiers may not be protected by bond)', 'Not Available', 'Notice of Claim on Bond: to contractor within 90 days after last labor or material furnished. §11-35-3030', 'Not Available', 'All suits filed within 1 year of last performance or furnishing of materials.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(188, 42, 1, 'Mechanics\' Lien', 'Contractor, Subcontractor, Materialman', 'Not Required', 'Copy of Lien Statement: To owner by certified mail before filing the Lien Statement and within 120 days from the last day material or labor was provided with copy of lien statement and post office receipt attached to lien statement and filed with Register of Deeds S.D.C.L. §44-9-17', 'File suit within 6 years of date of last performance. S.D.C.L. §44-9-24', 'File suit within 6 years of date of last performance. S.D.C.L. §44-9-24', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(189, 42, 2, 'Lien on Unpaid Retention', 'Subcontractor, Materialman', 'None Required', 'Account of Claim: To officer of public body within 20 days of last performance. §5-22-2.', 'Not Available', 'File suit within 80 days of acceptance of work for which claim is made. S.D.C.L. §5-22-7.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(190, 42, 2, 'Suit on Payment Bond - Highway contracts', 'Subcontractor, Third Tier Subcontractor', 'Not Required', 'Notice to contractor of claim within 6 months of last performance. S.D.C.L. §31-23-2.', 'Not Available', 'All suits must be filed within 1 year of final settlement of contract. S.D.C.L. §31-23-4.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(191, 43, 1, 'Mechanics\' Lien: Commercial Property', 'Contractor with owner: Mechanic, Contractor, Founder, Machinist', 'Not Required', 'Not Required', 'Sworn Statement of Amount Due: Recorded within 90 days after completion of contract to protect lienor against subsequent purchasers or encumbrances for value. T.C.A. §§ 66-11-112 to 117.', 'File suit within 1 year after completion of work.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(192, 43, 2, 'State Highway Projects - Suite on received funds', 'Subcontractor, Materialman, Laborer', 'Not Required', 'Must file claim within 30 days of first publication of Notice of Final Settlement.', 'Not Available', 'File suit with in 60 days of last advertising.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(193, 45, 1, 'Suit on Payment Bond - Minimum 100% & Suit Against Owner for Failure to Require such Bonds', 'Subcontractor, Materialman', 'Not Required', 'Not Required', 'Not Available', 'File suit not less than 90 days after completion, abandonment or default, but not more than 1 year after performance by subcontractor or materialmen (get copy of bond for specific provisions).', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(194, 42, 2, 'Suit on Payment Bond - minimum of contract price', 'Subcontractor, Materialman', 'None Required', 'Notice of Claim to general contractor within 120 days of contractor\'s first publication of notice to file claims S.D.C.L. §5-22-9', 'Not Available', 'If public agency does not sue within 6 months of final settlement of contract, claimant may sue within 1 year thereafter. S.D.C.L. §5-21-6.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(195, 43, 1, 'Mechanics\' Lien: Commercial Property', 'Contracts with: Prime Contractor or Remote Subcontractor -- Commercial Property Only (Subcontractors & Materialmen not in privity with the Owner have no lien rights as to residential property)', 'Notice of Non-payment: To Owner and Contractor within 90 days (delivered by certified mail) after the last day of each month in which work or materials were provided stating name and address of subcontractor or materialman, last date services or materials provided, general description of work, and property description (Failure to provide notice precludes subsequent lien claim) T.C.A. 66-11-145 and within 30 days of filing of Notice of Completion T.C.A. 66-11-143', 'Such lien shall relate to & take effect from the time of the visible commencement of operations, excluding demolition, surveying, excavating, clearing, filing or grading & delivery of materials thereof. If there be a cessation of all operations at the site of the improvement for more than 90 days, any lien for labor of any nature furnished after the visible resumption of operations shall relate to & take effect only from said visible resumption of operations. T.C.A. 66-11-104', 'Notice of Lien: To Owner within 90 days after last work performed or materials supplied. If not done within that time period, record and serve within 90 days after completion of project. Record notice by registering statement  of amount due for work or material furnished with County Register in County where premises or any part are  situated. T.C.A. 66-11-115, 117', 'Must file suit within 90 providing owner with notice of lien.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(196, 43, 1, 'Mechanics\' Lien: Residential Property', 'Contractor', 'Not Required', 'Written notice to Owner within 90 days of substantial completion and within 10 days of filing of Notice of Completion T.C.A. §§ 66-11-146 and 143 For priority over mortgage lienor, must give notice to mortgage holder. T.C.A. 66-11-108', 'All parties must register to maintain priority over third parties. T.C.A. 66-11-117', 'File suit within 1 year after last furnishing labor or materials. T.C.A. 66-11-106', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15');
INSERT INTO `lien_bound_summaries` (`id`, `state_id`, `project_type_id`, `rights_available`, `claimant`, `prelim_notice`, `other_notice`, `lien`, `suit`, `notes`, `created_at`, `updated_at`) VALUES
(197, 43, 2, 'Suit on Payment Bond on contracts over $10,000.00', 'Prime Contractor, Subcontractor, Materialman, Laborer', 'None Required', 'Notice of Claim on Bond (Public Project): To either Contractor who executed bond or to public official within 90 days from date last labor or material was supplied. If not done within that time period, make claim within 90 days of project completion. T.C.A. 12-4-205', 'Not Available', 'File suit within 6 months of completion of project. T.C.A. 12-4-206', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(198, 43, 2, 'State Highway Projects - Suit on Payment Bond', 'Subcontractor, Materialman, Laborer', 'Not Required', 'Must make claim within 90 days from date last labor or material was supplied. If not done within that time period, make claim within 90 days of project completion. (Retainage funds look at publication statute)', 'Not Available', 'File suit within 1 year following date of first publication of acceptance.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(199, 45, 1, 'Mechanics\' Lien', 'Contractor, Subcontractor, Materialman', 'Not Required', 'Not Required', 'Notice of Lien: Record w/in 90 days from last performance of labor or service or last furnishing of equipment or material under prime contract. Lien not available on certain residential projects. §38-1-7', 'File suit within 12 months after last performance of labor or service or last furnishing of equipment, except residential project, which is 180 days from last furnishing of labor, services, equipment or material. 2000 Utah Laws §38-1-11', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(200, 45, 1, 'Mechanics\' Lien', 'Second tier Subcontractor, second tier Materialman (not in privity with the original contractor)', 'Preliminary Notice: To original contractor within 45 days of first performance. §38-1-27', 'Not Required', 'Notice of Lien: Record w/in 90 days from last performance of labor or service or last furnishing of equipment or material under prime contract. Lien not available on certain residential projects. §38-1-7', 'File suit within 12 months after last performance of labor or service or last furnishing of equipment, except residential project, which is 180 days from last furnishing of labor, services, equipment or material. 2000 Utah Laws §38-1-11', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(201, 45, 1, 'Suit on Payment Bond - Minimum 100% & Suit Against Owner for Failure to Require such Bonds', 'Second tier Subcontractor, Second tier Materialman (Not in privity with Original Contractor)', 'Preliminary Notice: To Payment Bond principal within 45 days of first performance.', 'Not Required', 'Not Available', 'File suit not less than 90 days after completion, abandonment or default, but not more than 1 year after performance by subcontractor or materialmen (get copy of bond for specific provisions).', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(202, 45, 2, 'Suit on Payment Bond - minimum 100% & suit against owner for failure to require such Bonds', 'Second Tier Subcontractor, Second Tier Materialman (Not in privity with Original Contractor)', 'Preliminary Notice to Bond Principal within 45 days of first performance.', 'If no bond required by owner notice within 90 days of final furnishing.', 'Not Available', 'File suit not less than 90 days nor more than 1 year after last performance by subcontractor or materialman.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(203, 46, 1, 'Mechanics\' Lien', 'Subcontractor', 'Notice of Intent to claim lien to owner.', 'Notice to Owner: Within 120 days of date payment due for last material provided or services performed.', 'Memorandum of Lien: Record within 120 days of date payment due for last material provided or services performed. T. 9 §1923', 'File suit & obtain judicial attachment of property within 3 months of date of lien filing or date payment was due. Judgment must be filed within 5 months after obtaining judgment.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(204, 46, 2, 'Suit on Payment Bond - Highway Contracts and for any Project of the Agency for the Construction of a Transportation Improvement', 'Subcontractor, Materialman, Contractor', '(ALL CREDITORS)', 'Sworn Statement of Claim: To Secretary of Agency of Transportation within 90 days after final acceptance of project or within 90 days of date taxes or contributions to VT Commissioner of Employment Training are due & payable. T. 19 § 10(9).', 'Not Available', 'File suit within 1 year of filing of claims.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(205, 47, 1, 'Mechanics\' Lien', 'Contractor', 'Notice to Mechanics\' Lien Agent: For one or two family residential dwelling units: - If building Permit issued prior to work: To agent within 30 days of first performance, or - If the work is first performed prior to the issuance of a building permit: Within 30 days after the building permit is issued.', 'Not Required', 'Memorandum for Mechanics\' Lien: Must either be filed 90 days from the last day from the month in which last performance of labor or material furnished, but no later than 90 days from the time such building or project is completed or work otherwise terminated. Lien will only cover work performed 150 days prior to the last date on which labor was performed or materials furnished. § 43-4', 'File suit before latter of 6 months from lien filing or 60 days after project completion. §43-17', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(206, 47, 1, 'Mechanics\' Lien', 'Subcontractor, Materialman', 'Notice to Mechanics\' Lien Agent: For one or two family residential dwelling units: - If building Permit issued prior to work: To agent within 30 days of first performance, or - If the work is first performed prior to the issuance of a building permit: Within 30 days after the building permit is issued.2 §43-4.01', 'Not Requires', 'Memorandum for Mechanics\' Lien: Must either be filed 90 days from the last day from the month in which last performance of labor or material furnished, but in no event later than 90 days from the time such building or project is completed or work otherwise terminated. [Send Notice of Claim to owner lower tier subcontractor and materialmen to both owner & general contractor.] Lien will only cover work done up to 150 days before last date on which labor was performed or materials furnished. § 43-7,9', 'File suit before latter of 6 months from lien filing or 60 days after project completion. §43-17', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(207, 47, 1, 'Personal Liability of Owner/General Contractor', 'Subcontractor, Materialman', 'Notice of work to be done before subcontractor begins work. (§ 43-11 notice )', 'Notice of Claim: For unpaid sums to owner & general contractor after final performance and within 30 days of project completion. Notice & return of service must be filed.', 'Not Available', 'File suit before latter of 6 months from Notice filing or 60 days after project completion. §43-17', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(208, 47, 2, 'Suit on 100% Payment Bond for contracts over $100,000.00', 'Subcontractor, Materialman', 'Not Required', 'Not Required', 'Not Available', 'File suit no sooner than 90 days or later than 1 year after last work performed or materials delivered (within 5 years of completion if work for the VDOT).', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(209, 47, 2, 'Suit on 100% Payment Bond for contracts over $100,000.00', 'Sub-subcontractor (in privity w/Subcontractor but not w/Contractor)', 'Not Required', 'Notice of Claim: To general contractor within 180 days from the last day of work or of delivery of materials.', 'Not Available', 'File suit no sooner than 90 days or later than 1 year after last work performed or materials delivered (within 5 years of completion if work for the VDOT).', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(210, 48, 1, 'Mechanics\' Lien', 'Contractor, Subcontractor, Materialman', 'Notice to Owner : - Commercial and multi-family: To owner within 60 days of first delivery; - Single Family Residence: 10 days from first delivery. R.C.W. 60.04.031(4)', 'Not Required', 'Claim of Lien: Record within 90 days after last performance, with copy to Owner & Prime Contractor. R.C.W. 60.04.091', 'File suit within 8 months after lien recorded.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(211, 48, 1, 'Notice to Real Property Lender', 'Contractor, Subcontractor, Materialman', 'Not Required', 'Notice to Real Property: Lender to Lender, Owner & Contractor not less than 5 days, nor more than 35 days after payment is due. R.C.W. 60.04.221', 'Not Available', 'Not Available', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(212, 48, 2, 'Suit on Payment Bond - 100% of prime contract price', 'Subcontractor, Materialman', 'Preliminary Notice of Claim on Bond: To prime contractor within 10 days after first performance. R.C.W. 39.08.065', 'Notice of Claim on Bond: To Public Authority within 30 days after formal acceptance of project. R.C.W. 39.08.030', 'Not Available', 'File suit not less than 30 days after Notice of Claim recorded if attorneys fees wanted, but not later than 6 years of final furnishing. (usually corresponds with the 4 month litigation period for suit against retainage).', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(213, 48, 2, 'Lien & Suit Against Retainage', 'Subcontractor, Sub-subcontractor, Material-man to Subcontractors and Sub-Subcontractors', 'Preliminary Notice of Claim on Retained Percentage: - If not in privity with general contractor: To Prime Contractor within 60 days after first performance. To reserve right against retainage. If not in privity with General Contractor MUST furnish a Notice of Claim within ten (10) days to preserve rights against bond. R.C.W. 39.08.065', 'Notice of Claim on Retained Percentage: File with Public Authority within 45 days after formal acceptance of project. R.C.W. 60.28.011', 'Not Available', 'File suit within 4 months after filing Notice of Claim.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(214, 49, 1, 'Mechanics\' Lien', 'Original Contractor', 'None Required', 'None Required', 'Notice of Mechanics\' Lien: Record within 90 days of last performance. W. VA. Code §38-2-7 and 8', 'File suit within 6 months of lien recording. W. VA. Code §38-2-34', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(215, 49, 1, 'Mechanics\' Lien', 'Subcontractor, Materialman (to original contractor)', 'None Required', 'Notice of Mechanics\' Lien: Served within 75 days of completion of subcontract or last materials furnished, whichever is later. W.VA. Code §38-2-9 and 11', 'Notice of Mechanics\' Lien: Record within 90 days of last performance. W. VA. Code §38-2-9', 'File suit within 6 months of lien recording. W. VA. Code § 38-2-34', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(216, 49, 1, 'Bond', 'Mechanic\'s Lienor', 'Owner may record contract and require general to post bond before work commences. Owner has no lien liability above bond.', 'Not Required', 'Not Available', 'Not Available', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(217, 49, 2, 'Suit on Payment Bond in Reasonable Amount (Highway 100%)', 'NO SPECIAL STATUTORY PROVISIONS FOR NOTICE OR SUIT.', 'NO SPECIAL STATUTORY PROVISIONS FOR NOTICE OR SUIT.', 'NO SPECIAL STATUTORY PROVISIONS FOR NOTICE OR SUIT.', 'NO SPECIAL STATUTORY PROVISIONS FOR NOTICE OR SUIT.', 'NO SPECIAL STATUTORY PROVISIONS FOR NOTICE OR SUIT.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(218, 50, 1, 'Mechanics\' Lien', 'Contractor (with certain exceptions)', 'Contractor\'s Preliminary Notice: To owner of potential claims of subcontractors to be included in all written contracts or served personally or by registered mail within 10 days after first labor or materials furnished for the improvement by or pursuant to authority of prime contractor if no written contract. Form & language of notice specified generally in statute. (Sec.§779.02(2))', 'Notice of Intent to File a Lien Claim: To owner at least 30 days before the timely filing of the lien claim after substantial completion of the specific contractor\'s work. Served personally or by registered mail with return receipt requested. (Sec. 779.06(2))', 'Claim of Lien: Record within 6 months after lien claimant furnished last labor or materials. (Sec. 779.06(1),(3))', 'File suit within 2 years after lien recorded with Clerk of Circuit Court. (Sec. 779.06(1))', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(219, 50, 1, 'Mechanics\' Lien', 'Equipment Lessors (Lessors have no Lien Rights)', 'Not Required', 'Not Required', 'Not Available', 'Not Available', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(220, 50, 1, 'Mechanics\' Lien', 'Subcontractor, Materialman (no limit on tiers with certain exceptions) Note: If prime contractor, pursuant to agreement with the owner, furnishes a Payment Bond meeting the requirements of WSA 779.035, then the subcontractor\'s and material supplier\'s lien rights are extinguished and any claim must be made against the bond. (Sec. 779.03(2) and Sec. 779.035(1))', 'Non-Contractor\'s Preliminary Notice: 2 copies served personally or by registered mail, return receipt requested to owner of potential claims within 60 days of first performance or delivery by subcontractor or materialman. Form and language specified generally in statute. Certain statutory exceptions. These exceptions include: large projects in excess of 10,000 usable square feet of \"new\" floor space that is at least partially  non-residential and for residential projects \"providing or adding more than 4 family living units\". §779.02(1) WSA. § 779.02(2)(b)', 'Notice of Intent to File a Lien Claim: To owner at least 30 days before the timely filing of the lien claim after substantial completion of the specific contractor\'s work. Served personally or by registered mail with return receipt requested. (Sec. 779.06(2))', 'Claim of Lien: Record within 6 months after lien claimant furnished last labor or materials. (Sec. 779.06(1),(3))', 'File suit within 2 years after lien recorded with Clerk of Circuit Court. (Sec. 779.06(1))', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(221, 50, 1, 'Suit on Payment Bond', 'Subcontractor, Materialman', 'The subcontractor must notify the prime contractor in writing within 60 days of FIRST performance unless: Contract does not exceed $5,000; subcontractor or supplier is listed in written contract, or in a document appended to a written contract between a subcontractor or supplier and the prime  contractor; or the claim is made by an employee of the prime contractor, subcontractor, or supplier. (§779.035(2))', 'Not Required', 'Not Available', 'File suit within 1 year after completion of the contract or according to the terms of the payment bond against surety. (§779.035(2))', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(222, 50, 1, 'Lien on Funds not yet paid to contractor where Payment Bond issued', 'Subcontractor, Materialman of Prime Contractor or Subcontractor only', 'Notice of Claim: To Owner and Lender prior to funds being paid to contractor, and to Contractor or Subcontractor within 7 days after service of notice upon owner and lender. Written Notice of Claim by registered mail, return receipt requested. If contractor does not dispute claim: Within 30 days, the claim must be paid on demand. (Sec. 779.036(1)-(3)', 'Not Required', 'Not Available', 'File suit within 3 months after Notice of Claim is served on owner and lender if contractor disputes claim. (Sec. 779.036(3))', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(223, 50, 2, 'Suit on Payment Bond', 'Subcontractor, Materialman who have a direct contract with prime contractor or a 1st tier subcontractor (coverage exceptions possible against 2nd tier coverage on Wisc. highway projects (§779.14(1))', 'The subcontractor must notify the prime contractor in writing within 60 days of FIRST performance unless: Contract does not exceed $5,000; subcontractor or supplier is listed in written contract, or in a document appended to a written contract between a subcontractor or supplier and the prime contractor; or the claim is made by an employee of the prime contractor, subcontractor, or supplier. (§779.14(2)', 'Not Required', 'Not Available', 'File suit within 1 year after completion of work under prime contract naming prime contractor and bond sureties. (§779.14(2)', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(224, 51, 1, 'Mechanics\' Lien; Civil action with limited rights', 'Contractor', 'Notice to Owner: To Owner or his agent within 30 days of first performance on residential projects by contractor. Notice must be in 10 point bold type of a specific nature pursuant to WY Statute §29-2-110.', 'Notice of Intention to File Lien: To owner 10 days before recording. Please consult the WY Statutes pertaining to the construction of single family dwellings which requires additional notification to the owner and contractor.', 'Lien Statement: Record not more than 120 days after last work performed or materials delivered or not more than 120 days after  substantial completion, whichever is earlier. WY Statutes §29-1-301; 29-2-106', 'File suit within 180 days after lien is recorded.', '1 The statutes herein summarized pertain to the general construction law of Wyoming. Specific legislation\ngoverns the creation and perfection of liens with regard to the following types of property: mines, quarries,\noil, gas and other wells, ditches, canals, reservoirs, harvesting machines, breeding animals, house trailers,\nand personal property. When considering a lien on these types of properties, the provisions of Wyoming statutes 29-3-101 through 29-7-301 should be consulted.\n\n2 The Prime Contractor must post on the construction site a prominent sign citing Wyoming Statute Section\n29-2-111 and stating that any Subcontractor or Materialman shall give notice to the Prime Contractor of\nthe right to claim a lien and that failure to provide the notice shall waive the Subcontractor or Materialman\'s right to a lien.', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(225, 51, 1, 'Mechanics\' Lien; Civil action with limited rights', 'Subcontractor', 'Notice to Owner: To Owner or His agent w/in 30 days of first performance by subcontractor. (residential projects only). Notice must be in 10 point bold type of a specific nature pursuant to WY Statute §29-2-110.', 'Notice of Intention to File Lien: To owner 10 days before recording. The Subcontractor and/or Materialman should also give notice to the Owner and any other person having an interest in the real property and improvements, including the lending institution.', 'Lien Statement: Record not more than 90 days after last work performed or materials delivered under contract, or not more than 90 days after substantial completion, whichever is earlier. Employee or Subcontractor: (no written contract) file within 90 days after the last day he performed work at the direction of his Employer or Contractor. § 29-2-106(a)(iii)', 'File suit within 180 days after lien is recorded.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(226, 51, 1, 'Mechanics\' Lien; Civil action with limited rights', 'Subcontractor, Materialman', 'Notice of Right to Claim Lien: To prime contractor or his agent within 60 days of first furnishing services or materials, by certified mail or delivered (only for claims of $50,000.00 or more). Statute §29-2-111.', 'Notice of Intention to File Lien: To owner 10 days before recording. The Subcontractor and/or Materialman should also give notice to the Owner and any other person having an interest in the real property and improvements, including the lending institution.', 'Lien Statement: Record not more than 90 days after last work performed or materials delivered under contract, or not more than 90 days after substantial completion, whichever is earlier. Employee or ubcontractor: (no written contract) file within 90 days after the last day he performed work at the direction of his Employer or Contractor. WY Statutes §29-2-106(a)(iii)', 'File suit within 180 days after lien is recorded.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(227, 51, 2, 'Suit on Payment Bond - Work having a value between $7,500.00 & $100,000.00 Minimum 50% bond. Under $5,000.00, no bond required. Over $100,000.00, the appropriate officer, agent or the governing body m', 'Contractor', 'Must post on construction site a prominent sign siting relevant Sections, and notifying Subcontractors and Materialmen of right to protection under the bond. § 16-6-121.', 'Not Available', 'Not Required', 'Not Required', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15'),
(228, 51, 2, 'Suit on Payment Bond - Work having a value between $7,500.00 & $100,000.00 Minimum 50% bond. Under $5,000.00, no bond required. Over $100,000.00, the appropriate officer, agent or the governing body m', 'Contractor', 'Notice to Contractor: To Prime Contractor no later than 60 days after the date on which services or materials are first furnished. Notice to be served by certified mail or delivery to Prime Contractor or his agent. Specific requirements provided § 16-6-121, and applies where Prime Contractor\'s contract is for $50,000.00 or more.', 'Not Available', 'Not Required', 'File suit within 1 year after the date of first publication of notice of final payment of the contract.', 'NULL', '2018-03-23 06:58:15', '2018-03-23 06:58:15');
