(5, 3, 2, 'Lien Against Public Funds', 'Not Available', 'Not Covered ', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(6, 3, 1, 'Mechanics Lien', 'Preliminary notice to owner, original contractor, construction lender & person with whom claimant has contracted within 20 days of first performance.  ', 'S, SS, SSS, M, MS, MSS', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(7, 4, 2, 'Public Bond Claim', 'Action on bond must be brought within 6 months from date final payment is made on contract.  ', 'No Tier Limit', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(8, 4, 2, 'Lien Against Public Funds', 'Not Available', 'Not Covered ', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(9, 4, 1, 'Mechanics Lien', 'Notice to owner or reservation of right to file lien before perf. Give owner 10 day notice before filing lien. Material man send Notice of Claim to owner and GC within 75 days of furnishing.  ', 'S, SS, SSS, M, MS, MSS', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(10, 5, 2, 'Public Bond Claim', 'Serve Preliminary Notice on owner, prime contractor and construction lender within 20 days of first performance.  ', 'No Tier Limit', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(11, 5, 2, 'Lien Against Public Funds', 'Serve preliminary notice on prime contractor and public agency within 20 days of first performance.  ', 'S, SS, SSS, M, MS, MSS', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(12, 5, 1, 'Mechanics Lien', 'Prelim notice of potential  claim to owner, prime contr & Constr lender within 20 days after 1st perf to preserve full amt of lien claim.  ', 'S, SS, SSS, M, MS, MSS', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(13, 6, 2, 'Public Bond Claim', 'For proj. over $50,000 no notice req\'d. File suit within 6 months of substant completion of project.  ', 'S, SS, SSS, M, MS, MSS', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(14, 6, 2, 'Lien Against Public Funds', 'Verified statement of claim to public authority before final settlement of project, file suit within 90 days of notice.  ', 'S, SS, SSS, M, MS, MSS', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(15, 6, 1, 'Mechanics Lien', 'Notice of intent to owner and contractor 10 days before recording lien, Notice to Disburse Direct sent to disbursing party as long as funds remain to be paid.  ', 'S, SS, SSS, M, MS, MSS', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(16, 7, 2, 'Public Bond Claim', 'Notice of claim to surety, contractor and public authority between 60 days of statutory payment due date and 180 days of last performance.  ', 'S, SS,  M, MS', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(17, 7, 2, 'Lien Against Public Funds', 'Not Available', 'Not Covered ', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(18, 7, 1, 'Mechanics Lien', 'If contract not signed by owner, notice to owner and prime contr within 90 days of last perf. Otherwise no notice req\'d but record lien within 90 days of last perf.  ', 'No Tier Limit', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(19, 8, 2, 'Public Bond Claim', 'No prelim req\'d. File suit w/in 1 year of last perf if bond provides, otherwise w/in 3 years.  ', 'S, M (unless bond lacks statute\'s limiting language)', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(20, 8, 2, 'Lien Against Public Funds', 'Not Available', 'Not Covered ', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(21, 8, 1, 'Mechanics Lien', 'General contr file lien within 180 days after project completion. All others file lien within 120 days of last perf.  ', 'No Tier Limit', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(22, 9, 2, 'Public Bond Claim', 'If not in privity with contr, notice to prime contr within 90 days after last perf. Otherwise, file suit between 90 days and 1 year after last perf.  ', 'No Tier Limit', '2018-03-26 05:19:57', '2018-03-26 05:19:57'),
(23, 9, 2, 'Lien Against Public Funds', 'Not Available', 'Not Covered ', '2018-03-26 05:19:58', '2018-03-26 05:19:58'),
(24, 9, 1, 'Mechanics Lien', 'Serve notice to owner as soon as claim arises to ensure maximum protection (claim limited to amount due GC).  Record within 90 days of last performance.  ', 'S, M', '2018-03-26 05:19:58', '2018-03-26 05:19:58'),
(25, 10, 2, 'Public Bond Claim', 'If no contract with GC, Notice of intention to look to bond to prime contr and owner within 45 days of 1st perf.  ', 'S, SS, M, MS', '2018-03-26 05:19:58', '2018-03-26 05:19:58'),
(26, 10, 2, 'Lien Against Public Funds', 'Not Available', 'Not Covered ', '2018-03-26 05:19:58', '2018-03-26 05:19:58'),
(27, 10, 1, 'Mechanics Lien', 'Notice to owner, and prime contractor within 45 days of first performance and before final payment.  For specifically fabricated goods time period begins with fabrication.  ', 'No Tier Limit', '2018-03-26 05:19:58', '2018-03-26 05:19:58'),
(28, 11, 2, 'Public Bond Claim', 'If no contract with GC and NOC filed, send notice w/in 30 days of notice or 1st perf, whichever is later.  If no notice, send within 90 days of last perf.  ', 'S, SS, SSS, M, MS, MSS', '2018-03-26 05:19:58', '2018-03-26 05:19:58'),
(29, 11, 2, 'Lien Against Public Funds', 'Not Available', 'Not Covered ', '2018-03-26 05:19:58', '2018-03-26 05:19:58'),
(30, 11, 1, 'Mechanics Lien', 'Owner/GC record Notice of Commencement within 15 days of 1st performance.  Subs send prelim notice to GC and owner within 30 days of 1st perf.  ', 'S, SS, SSS, M, MS, MSS', '2018-03-26 05:19:58', '2018-03-26 05:19:58'),
(31, 12, 2, 'Public Bond Claim', 'Notice to GC and surety within 90 days of last perf.  ', 'S, M', '2018-03-26 05:19:58', '2018-03-26 05:19:58'),
(32, 12, 2, 'Lien Against Public Funds', 'Not Available', 'Not Covered ', '2018-03-26 05:19:58', '2018-03-26 05:19:58'),
