(690, 201, 161, 'Notice of Demand For Payment of Account & Notice of Intent to Enforce Mechanics Lien prior to disbursement of funds (15 days before lien)', 'Notice of Demand For Payment of Account & Notice of Intent to Enforce Mechanics Lien prior to disbursement of funds (15 days before lien)', 0, 0, 0, 0, '', '1', '1', NULL, '2018-01-18 14:36:47', '2018-01-18 14:36:47'),
(691, 202, 161, 'Record Mechanic\'s Lien At Anytime Undisbursed Funds Available But Good Practice to Record Prior to Funds Disbursed and In Any Event Within 90 days of Your Last Contribution of Labor/Material 90 days of last performance', 'Record Mechanic\'s Lien At Anytime Undisbursed Funds Available But Good Practice to Record Prior to Funds Disbursed and In Any Event Within 90 days of Your Last Contribution of Labor/Material 90 days of last performance', 0, 0, 90, 0, 'Note:  A failure to file the lien account within ninety days does not defeat the lien except as against purchasers or encumbrancers in good faith and for value whose rights accrue after the ninety days and before any claim for the lien is filed, and as against the owner to the extent of the amount paid to a contractor after the expiration of the ninety days and before the filing of the account. (Good Practice- Record Within 90 Days of Your Last Contribution of Labor and Materials Following Your Service of the Notice of Account 15 Days prior to Recording Your Mechanic\'s Lien)', '1', '1', NULL, '2018-01-18 14:36:47', '2018-01-18 14:36:47'),
(692, 203, 161, 'File Suit to Enforce Mechanic\'s Lien 3 years of Notice of Intent', 'File Suit to Enforce Mechanic\'s Lien 3 years of Notice of Intent', 3, 0, 0, 0, 'Note 1 - Upon written demand of the owner, that person\'s agent, or contractor, served on the person holding the lien, suit must be commenced and filed with the clerk of court within thirty days thereafter or the lien is forfeited. The demand must contain a provision informing the person holding the lien that if suit is not commenced within thirty days, the person holding the lien forfeits the lien. No lien is valid or effective as such, nor may be enforced in any case, unless the holder thereof asserts the same by complaint filed with the clerk of court within three years after the date of recording of the verified notice of intention to claim a mechanic\'s lien.', '1', '1', NULL, '2018-01-18 14:36:47', '2018-01-18 14:36:47'),
